		["1206222123bJn4F"] = {
			["data"] = {
				["IC"] = "Warlock_Summon_DoomGuard",
				["read"] = true,
				["NH"] = "ff0b00",
				["TX"] = "Korvok darkened the skies during the war of the ancients and hunted fleeing nightelves with glee. Gorging on their flesh and blood it absorbed and accumulated what little magical energies they had within them. After thousands of victims, Korvok grew powerful enough to overthrow his master Mephistroth and roamed Azeroth terrorising anyone who happened to come across his path.\n\nThis went on until the demon came across a nightelf called Celestia who wielded an enchanted spear called Ascalon. They battled for days and finally Celestia plunged her spear into the demon's heart, destroying his body, but not his spirit. The demon's incorporeal form travelled for millenia in the Twisting Nether until his body was reformed and sent to invade Azeroth once again during the Legion Invasion.\n\nKorvok is an extremely powerful demon which very rarely seen around Aros. Requiring all his power to control him, Aros is usually unable to attack or otherwise defend himself while controlling this being of demonic destruction.",
