				["read"] = false,
				["NH"] = "740070",
				["TX"] = "Graz'juk is a swirling mass of void energies which seem to shimmer in and out of existence while emanating an aura of dread and desperation. The demon materialised before Aros when he was but a child, escaping from the ogre's encampent in Deadwind Pass. The voidwalker speaks only to Aros and it is rumored that his words instill madness into the warlock's mind.\n\nThe title \"Bane of Ogres\" was given to the Voidwalker by Aros himself after decimating the entire populations of ogres which held the warlock in captivity.",
