			["about"] = {
				["v"] = 96,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://www.youtube.com/watch?v=Awk_1S5L5ZY*Music!}\n\n-Artwork-\n\n{link*https://imgur.com/TYIoJGw*By Rhonazha}\n\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n‘’ The maiden of the Blue Bird, immortal and fair.\n    Never did she waver, always was she there.\n\n\nWhere aid was required, the sorceress of Hale.\nHer gentle touch of magic and keen mind for sale.\n\n\n    Many battles she had fought and lost all that was dear.\n    Once a neutral party - powerful and sane,\n     A woman led by fear now, driven by pain. \n\n\nTrinkets and charms speak of what she knows.\nHer cold and broken heart still caring,\nA side that she not often shows.\n\n\n    Scars hint at her history,\n    But most of that remains a mystery. ’’\n\n\n\n\n-    ( The Bard Concratius about Dahlia Hale, in the Chronicles of the Sea*)\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n\n{img:Interface\\LFGFRAME\\LFGICON-ZONE:256:256}\n\n\n\n\n",
				},
