						["AC"] = true,
						["TX"] = "Tall, Dainty, Fit - Mature looking woman.\nAppears to be in her mid-twenties.\n\nScars mark her back and three deep claw scratches can be seen in her neck.\n\nLong ashen blonde hair with stripes of silver that reaches as far down as to her hips.\n\nOne single braid decorated with beads and feathers.\n\nNose piercing ( ring )\n",
					},
					["3"] = {
						["TX"] = "Behind her lower back, hidden underneath her cloak-  a thin short sword is strapped against her corset.\n\nThe short curved weapon is engraved with runic symbols -  glowing when used",
						["IC"] = "Ability_Iyyokuk_Sword_White",
						["AC"] = true,
					},
					["2"] = {
						["TX"] = "Blue / Brown & White / Silver themed clothing.\n\nA single clasp keeps her cloak with fur together - depicting a Blue bird and hinting at the name of her former Ship.\n\nAll kinds of satchels and trinkets , are strapped against her belt and corset.\n\n",
						["IC"] = "INV_Robe_Leather_LegionEndGame_C_01",
