					["5"] = {
						["IC"] = "INV_Misc_Flower_04",
						["AC"] = true,
						["TX"] = "Surrounded by the scent of pine and flowers.\n\nAnd those with keen senses could feel / see her aura of raw - somewhat untamed - arcane energy\n\n\n",
					},
