				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Ellyth's left arm is severed at the forearm however a metal hand and forearm is visable, her left ear is missing the tip sliced down to semi-Human length, sliced off around 2/3rds of the way down. Her right eye is closed, a scar going down from the middle of her forehead over her right eye and finishing on her right cheek. Her entire body is laden with freshly closed wounds.\n\nBefore you is an Elf with simple garb, nothing fancy and nothing over the top, just light leather armour. Her body appears to have seen combat, with small scars scattered throughout her skin, and a powerful set of thighs and torso as well. She has blue/purple hair, usually unkempt but long and flowing, as well as baring the markings of a former sentinel.\n\nShe seems to carry an assortment of gear on her, she has two satchels which sit on the back of her beltline. She has two flintlock pistols strapped to the outside of her thighs further down her leg and also carries a rifle across her back. Finally, around her chest is a long length of rope with a grappling hook at the end of it, the hook dangles down by her right leg.\n\nShe carries an old greatsword at her hip, rusted, worn and broken, and on the hilt it is engraved \"Erelas\".\n\nTheme: Links 2 3 4 - Rammstein     https://www.youtube.com/watch?v=Ph-CA_tu5KA",
					},
					["HI"] = {
