			},
			["about"] = {
				["T1"] = {
					["TX"] = "\n{p:c}Youthful features clash with a classic build. Nedora has a slender face with enough weight on it to hide a strong bone structure. Though brows tug up in nice arches above two big eyes with the colour of olives that have been out in the sun too long, the edges of them give her a stern expression.\n\nShe has a young health to her that shows in her full hips. Her every step carries the same perk that is found in her rump. In contrast a modest upper body, lacking in form or definition. The black straight hair she has is kept in classy knots, buns or else styled with care, lose bits of it stroking over shoulders that give away lack of training.\n\nWith a formal set of poses it would be the expressive way she communicates that beams her character. Smiles flash up high, dramatic handmotions add detail and when she isn't forcing a classy image matched by her make-up choice she would be in motion constantly.\n\nThe smell of grass washed in bourbon follows her every step.{/p}",
