			["character"] = {
				["CO"] = "\n",
				["RP"] = 1,
				["CU"] = "\n",
				["XP"] = 2,
				["v"] = 62,
			},
			["about"] = {
				["v"] = 64,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-druid-cover:256:256}\n\n\n{p:c}Yllandil is an impressive caricature of her race, towering and sinuous in anatomical terms; blessed with lean muscle and ample athleticism archetypal of the Kaldorei.\n\nSome, albeit, subtle marks of age adorn Yllandil; the soft yellowing of her teeth, a chipped fang, faded laugh lines, and the almost imperceptible wrinkle all tarnish an otherwise unblemished complexion. Alongside this, the markings on her face are visibly faded, and broken by time in some places. \n\nHer arms are wrapped in twists of branch and blossom, which seem to move and grow of their own accord, imperceptible except to the focused eye - beneath these a similar weave of druidistic markings are strewn across her skin, each marking distinguishing a different school or form she's mastered. \n\nStrips of leather and silver ornamentation litter her scalp, the majority of which represent some reverence to Elune or her children though a few seem to be dedicated a nomadic lifestyle - the cities of Stormwind, Gilneas, Gnomeregan, Thunder Bluff and the Exodar all feature.\n\nWhat seem to be little more than stone daggers rest at her side, the artisanal side of weapon craft having escaped her apparent notice. Across her chest is a series of small satchels crafted in Elven style; each depicting different druidic forms and containing an assortment of herbs, reagents and other miscellany.\n\nEasily taller than most other races, her form is no less protected, with leather and cloth covering her more vital areas - though there is a conspicuous reliance on agility and other abilities judging by the scarcity of protection offered up by her armaments in certain areas.\n\nAs a consequence of her prolonged life, Yllandil has a certain senility that beguiles her outward appearance. A distinct, if occasionally, well-hidden narcissism pervades her character entirely. This is straddled with a predilection for sarcasm, and humour as a coping method in general{/p}\n\n\n\n",
				},
			},
			["zone"] = "Stormwind City",
		},
		["04261821461eyrv"] = {
			["character"] = {
				["CO"] = "It's almost like there are more 'Nobles' than there are anything else. Oh wait...",
				["RP"] = 1,
