			["time"] = 1518919808,
			["link"] = {
				["Sylandros-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "First thing you may notice about Sylandros, is that he is very small for a Worgen - Whilst he is muscular, he has a more lean build, made for agility and speed as opposed to brute strength. His height seems to have remained unchanged at a height of 6'1 (~1.85m).\n\nHis fur is rather unremarkable, a standard ashen-grey colour. However, on various parts of his body, to compensate for the fact tattooing a Worgen would be pointless, the fur is dyed in an artistic manner (see additional info on characteristics).\n\nHis physique is rather typical of a Worgen - In the sense he is relatively muscular, but seems to be of a lean build rather than bulky, or that of some of his kin, bearing obvious definition. His physique is also conditioned for hand-to-hand combat, including hardened knuckles. \n\nHis shoulders are relatively wide, before leading down his torso to a slim waist, creating a 'V' shape. In a normal shirt the sleeves hug his arms and shoulders, whilst the core hangs relatively loosely.\n\nHis fur is often clean and taken care of, but naturally wiry. His fangs are no different to any other Worgen's, however they may be somewhat less yellow due to not using them to bite into blood very often. Two braids hang from his head from excess fur.\n\nYet unlike the vast majority of \"muscular\" people, it does not mean he thinks he can make anyone else look like a child, as muscule proves little defence against knowing how to fight properly.\n",
						["BK"] = 2,
						["IC"] = "achievement_worganhead",
					}, -- [1]
					{
						["TX"] = "Often one to stand up for himself, particularly if mocked or threatened granted this does occasionally allow his short temper to flare.\n\nShould one, as so many often attempt to do, look directly into his soul via his eyes, they would not see much - Perhaps his gaze does not shatter under weight easily? Or perhaps there is little else than a void there? Who knows.\n\nUpon getting to know him, it'd be immediately obvious he does mask his true persona with jovial mannerisms, though this is not always the case and seems to switch rather easily between good and bad moods, making it difficult to like him, but those that manage to befriend him will find him to be loyal to them, if not obvious at first.",
