			["about"] = {
				["v"] = 32,
				["BK"] = 18,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ffffff}Rolard Grison is a built, almost burly man, by most metrics. His skin haggard and worn by years of poverty and manual labour. A man of military pedigree and deeply patriotic, he walks around the city with pride and a sense of belonging. In stark contrast to his otherwise run down appearance, his lightish auburn hair remains neatly combed and his beard groomed and trimmed.\n\nHis clothing reflects his military status, with Rolard usually seen in his mess order. His shirt is of the deepest Stormwind blue, with his breeches matching. The stitching and condition is of a high standard. He occassionally  wears the Stormwind colours to further show off his status.\n\nRolard's demeanor is assertive and stoic, with little sign of emotion towards a stranger per say. Despite this, once one has broken his guard down, Rolard is a rather hearty fellow who can discuss anything from the state of the kingdom to the price of mead, should anyone be interested in his ramblings.{/col}\n\n\n\n\n{p:c}{icon:Achievement_Garrison_Monument_Alliance_PVP:100}{/p}",
