			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "Draeguul's friendly features represent that of a doting father, from the crows feet areoung his eyes to the wrinkles on his oak-like, large hands.\n\nHe often has a pleasant expression on his face and would never hesitate to laugh, his hair is like a silken mane which blend into his sideburns, which are well tended to, as well as his beard which stays trimmed.\n\nThe gentemen is always one for cracking a joke or two, but knows (even if it's just to ignore it) when to be serious. If he is ever in a situation where others' lives are in jeaporady, he will be sure to help however he can and put himself as a seconday priority.\n\nWith that being said, the ferocity within him is bound to come out in almost uncharacteristic ways when he is pushed to his limits, and will not hesitate to use his experience in feral and minor balance druidism.",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "With a history of being a troublemaking, ditzy ruffian in his early years of adult life, Draeguul used to be the ladies-man of his friends. He was always up for a challenge and rarely turned down an offer if it carried enough interest.\nHe has always been a moral man, but throughout his years of growing up and alongside the love of his life, Saelbes, he learned how to be less selfish, and how to forgive.",
						["BK"] = 1,
					},
