			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-druid-cover:256:256}\n\n{h3:c}Manive's Apperance{/h3}\n{h3:c}{link*http://imgur.com/P9bbs69*Manive by Felox08}{/h3}\n\nManive stands 2.2meters tall in height. Her smooth skin is lavenderish-purple In her right ear is 2 earrings with a blue feather and a brown feather hanging in each ring.\nHer long and smooth hair is navy-blue, flowing down her back and slightly beyond her rear. Sprouting from said rear is a long bushy wolf-tail with matching colour to her skin following her legs down and slightly bends to avoid hitting the ground.\nShe has the smell of autum coming from her, and in her long hair is braided leaves here and there along it. \nHer face is slender and elegent with a soft nose and soft lips. \n\nOn her left neck/shoulder is a scar from a bitemark seeming to have been made by a large wolf. On her right hip is a scar on both her front and back from seemingly something that impaled her once.\n\nOn her left lower arm, on it's backside is a green feather tattoed into her fur. Darker green lines makes the tattoo seem more alive. \n\n(For those that can sense magic/curses)\n*An emerald colored aura surrounds her and a fierce presence can be sensed from her.*\n\n",
