		["0529215252SxK9E"] = {
			["character"] = {
				["CO"] = "What's a \"Not a DK IC\" anyway?\nArmor is not as spiky as it appears.\nTheme:\nGothic 3 - Northmar",
				["RP"] = 1,
				["CU"] = "6/6 HP\n\n0/3 Ebon Rage",
