			},
			["time"] = 1518920257,
			["link"] = {
				["Ycerim-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:fffd90}Skills:{/col}{/h1}\n\n{col:ffe98c}\n{icon:Ability_Warrior_StrengthOfArms:25}Endurance Training II: +2HP\n{icon:INV_Sword_1h_ArtifactRuneBlade_D01Dual:25}Runeblade Training: +1 to Attacks made with these weapons.\n{icon:ABILITY_HUNTER_HUNTERVSWILD:25}Wild Hunter: +2 to Attacks made against monsters.\n{icon:INV_Misc_Book_05:25}Magical Studying I: +2 to Magical Studying\n{icon:Warrior_talent_icon_Skirmisher:25}Vigorous Energy: +2 to Athletics/Acrobatics\n{icon:ABILITY_HUNTER_PATHFINDING2:25}Well-Traveled: +2 to Well-Traveled\n{icon:Ability_Mage_StudentOfTheMind:25}Enticing Words: +2 to Persuasion\n{/col}\n\n{h1:c}Special Items:{/h1}\n\n{icon:INV_Jewelry_Ring_02:25}{col:69ff7e}Ring of Focus: +1 to attack each turn, bonus removed when hit, stacks up to +4. +1 to Magical Studying.{/col}\n\n{h1:c}{col:3f85ff}Perks:{/col}{/h1}\n\n{col:6183ff}\n{icon:Ability_Warrior_Incite:25}Zealous Fighter: +5 to attack, +4 to initiative, Attack crit range is 19-20\n{icon:Ability_Warrior_StalwartProtector:25}Knightlyhood: +4 to Well-traveled, +4 to Persuasion, +3 to defense.\n{icon:Ability_Mage_PotentSpirit:25}Sage's Knowing: +6 to Knowledge, +4 to Persuasion, +4 to Magical Studying\n{icon:ABILITY_Rogue_ControlIsKing:25}Timeless Strategist: +2 attack vs. Humanoids, +2 Defense vs. Monsters, able to re-roll Nat 1 attack/def once per encounter.\n{icon:Ability_Warrior_InnerRage:25}Valiant Heart: +2 to Defense, +5 to Athletics/acrobatics, +4 to Persuasion\n{/col}\n\n\n\n{h1:c}{col:ff9933}Flaw: Eternal Hunger{/col}{/h1}\n{col:d1a13f}When you reach half your maximum health, 1 health or critically fail a defensive roll:\nYou become consumed by the Eternal Hunger. Either roll randomly of those within reach (of DM's choice), pick an ally to hit or pick an enemy to hit with a penalty.\nIf you roll randomly and an enemy is rolled, you do a normal attack against them. Rolling an ally also means you roll against them.. If you pick an ally, it's a guaranteed hit. If you pick an enemy, your attack is made by rolling against a DC set by the DM, hitting the threshold means an automatic 2 damage to the enemy.\nSucceeding in damaging another creature ends the Eternal Hunger's effect.\nFailing means taking one damage and all rolls are with disadvantage until the end of your next turn (or applicable if other effects can happen.)\n{/col}\n\n{h1:c}{col:673ec9}Ability: Ebon Reaver{/col}{/h1}\n\n{col:a843ff}As you damage enemies, you gain a charge of Ebon Rage up to a maximum of 3 charges. Damaging an ally while under the effect of your flaw awards 2 charges.\n1-3 Charges: Spend up to 3 charges to increase your defense and attack by +2 per charge. Stacks to 5 charges. Lasts for the remainder of the Encounter or until you reach 0 health.\n2 Charges: Stun an enemy. Enemies immune to being stunned have reduced attack thresholds for their next two attacks.\n3 Charges: Unleash the Fury of the Fallen, dealing a guaranteed critical strike and draining 1 HP from an enemy, adding it to your own health pool.\nAt the end of an encounter, all charges are lost.{/col}\n\n",
