						["IC"] = "INV_ValentineCologneBottle",
						["TX"] = "Keeping yourself clean when Undead is important. It'll make being around you less unpleasant and slow, if not halt the process of you decaying. Knowing this, Oscar has kept himself clean and his teeth brushed. How he keeps clean despite his homelessness isn't clear.",
