				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\nArt Concept: The AA link - Kaatey: \n\n{link*https://www.argentarchives.org/node/202627*Argent Archieves}\n\nBackstory ^\n\nTheme song:\n\n{link*https://www.youtube.com/watch?v=h3P2ob4sPfU*We're the last of our kind}\n\n{link*https://www.youtube.com/watch?v=vzDPIrEiS-U*Sunder - A music for hope and struggle}\n------------------------------------------------------------------\n\nCharacter Information:\n\n\n-Name:  [Natalia Demorzian]\n\n-Class:  [Commoner]\n\n-Ethics:  [Educated with manners and knowledge, lady-like]\n\n-Age:  [Twenty-five (25)]\n\n-Race:  [Half-Quel'dorei. Half-Human]\n\n-Natural Hair Color:  [Red]\n\n-Current Hair:  [Blonde]\n\n-Body-type:  [Lithe, Curvaceous, average weight]\n\n-Eye-color:  [Blue]\n\n-Height:  [5'8 Ft]\n\n-Personality:  [Optimistic, compassionate, loyal, funny, stupid, smart] (varies)\n\n-Obsession:  [Fashion, popularity, positivity]\n\n-Expertise:  [Medical department]\n\n-Powers & Abilities:  [None yet - Faint arcane energies]\n\n-Flaws:  [Breaks under pressure and stress, Naive at most times]\n\n-Language:  [Common, Thalassian]\n\n(ooc... 7 marks)\n----------------------------------------------------\n\nReminder to self, Defensive Items;\n\n-Comb for the hair, can be used as a [Blade] with a fling of the motion.\n\n-Red Rose for the hair, can be used as a [Needle] that is also switched into a longer thin [Blade].\n\n-Small knife strapped on her boots, either under her skirt or over her legging on the long boots (varies to which other styles she has)\n\n-Sword with sheath attatched to her belt.\n\n-Pepper Spray; the regular gnomish made 'hot' sauce spray which would damage the eyes for only a small duration!\n\n-Letter cutter; small little knife with a sheath hidden in her person, the chest area.\n\n\n\n\n\n",
