		["1025010631owBdL"] = {
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 1,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "Hawkes was most certainly an imposing figure, standing at a full six feet two tall, quite tall for a human female.\n\nHer mesomorphic and symmetrical build portrayed broad shoulders and an impressive torso, while her athletic musculature and sturdy frame were clearly the result of a rigorous training schedule, resulting in her awe-inspiring physique.\n\nHer visage was spared for the most part of scars and such, remaining mostly unblemished despite her experience and age. Her brow was pronounced but well-formed while her nose was small and dainty, granting her the characteristic hawk-like features of her namesake.\n\nHawkes had golden blonde hair down to her shoulders, though often it'd be neatly tied back into a ponytail for practical reasons. She had almond-shaped baby blue eyes that gave her a very kind and generous appearance.\n\nHawkes' first impression would likely be a friendly and attentive one, her personality only shiftin to a more brutal and effective one in the heat of the moment.",
						["IC"] = "Warrior_talent_icon_Thunderstruck",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Brooch",
						["TX"] = "Hawkes wore a brooch upon her person at all times, pinned to her clothing. It carried the Alliance sigil, a memento of her service as Knight-Captain Inquisitor in Alliance ranks. \n\nA grim and dark page in the Knight's history, a constant reminder of her resolve to aid Alliance efforts.\n\n",
						["IC"] = "PVPCurrency-Honor-Alliance",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Armor",
						["TX"] = "Hawkes donned a sturdy yet fairly light-weight set of layered plate armor, offering her ample protection from most attacks while not sacrificing too much mobility.\n\nUpon her belt would be a variety of pouches and bags, full of reagents, coin and an assortment of utilities, as well as a well-made dagger that could be easily drawn in an emergency.\n\nHawkes favored the longsword in combat, much preferring it's speed over the much more bulky greatsword, while still maintaining an impressive reach, especially in tandem with her physique.\n\nShe'd use the longsword in tandem with either a summoned shield or a spellbook, true to the nature that is the Battlemage's style of combat.",
						["IC"] = "inv_misc_legarmorkit",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Health",
						["TX"] = "Sophia is completely healthy!",
						["IC"] = "Ability_Warrior_BloodFrenzy",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Enchanted Ring",
						["TX"] = "Hawkes wore an enchanted ring of the Kirin Tor, indicating her membership of the illustrious organization. It was pristine condition and glowed with a dim blue hue.",
						["IC"] = "Achievement_Reputation_Kirintor_Offensive",
					},
				},
				["v"] = 30,
			},
			["time"] = 1519085028,
			["link"] = {
				["Hawkesy-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-mage-cover:128:128}{h2:c}{col:77c0ff}Dame Sophia Hawkes{/col}{/h2}\n{p:c}{col:ffffff}Hawkes was born in Stromgarde in the nation of Arathor. She began her studies as a mage at a very young age, showing quite some promise, especially in the schools of Conjuration and Illusion. Her studies would eventually lead her to the Mageocracy of Dalaran where she further honed her skills.\n\nIn tandem with her academic prowess, she also showed remarkable interest and skill with the blade, a hobby that she indulge in for the rest of her life. Sophia believes in a strong mind -and- a strong body, which led her maintain a fine balance between the two, choosing to use magic to bolster her martial ability. A so-called battlemage would eventually be born, her favored style of combat being effective and versatile.\n\nHer patriotism led her away from Dalaran as she became more and more invested in Alliance interests, eventually becoming an Inquisitor in the Alliance ranks: a torturer and investigator of less fortunate types that would no longer see the light of day. It is here she built her reputation of being an effective and cold interrogator, managing to yield answers from the most strong willed of victims. She would remain in service of the Crown for a long time, eventually retiring from the life a Knight-Captain. \n\n{/col}{/p}",
				},
