			["about"] = {
				["v"] = 13,
				["BK"] = 7,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-ArtifactTEMP:256:128}The torn clothes and often dirt-stained skin does give the man an overall worn look, still there's a youthfull sharpness to his facial lines without any clear wrinkles, though a few thin grooves have begun to take shape outwards from the corner of his eyes. He's quick to a smile and often found with a friendly expression plastered across his face, when in a good mood of course.\n\nHis skin doesn't lack scars and marks, though most are no more than thin, white lines strewn across back, arms and chest. The most notable mark he carries would be the burn-mark in the shape of a capital \"M\" burnt into his right palm.\n\nHe seems to be in rather fit shape, his pale, northern skin stretched over the well defined muscles on arms, legs and bulky torso. He's a man who has seen alot of demanding activity for sure.\n\nHis chestnut brown hair (When NOT shaved!) is often caught up in a mess, strands greasy and sticking together in thick stripes that drop down over neck, ears and forehead. His beard currently appears somewhat wildly grown, creating quite the bush over his chin.",
