						["AC"] = true,
						["TI"] = "{Shoot for the moon}",
						["TX"] = "Heather is equipped with a strong wooden bow that's decorated with intricate silver guilding, and a simple quiver made from fine looking leather. A collection of expertly crafted handmade arrows sit themselves in her quiver.",
						["IC"] = "INV_Misc_Quiver_01",
