					["3"] = {
						["AC"] = true,
						["TI"] = "{One for all}",
						["TX"] = "Tattoos of druidic origin snake their way up Heather's right arm, starting from her wrist to her shoulder. The most notable tattoo within the sleeve is one depicting a large snake; its head resting at her wrist as the rest of the reptile's body winds its way around her arm.\n(More in my about)\n\n*The markings aren't magical in any form.",
