					["2"] = {
						["AC"] = true,
						["TI"] = "{Only you can prevent forest fires}",
						["TX"] = "The smell of tobacco sticks to Heather, with an underlying scent of the forest and nature mixing in.\n\nTied around Heather's neck is a simple bandana, the colour of such often matching her current attire with the most commonly seen bandana being a jade green colour.",
