			["zone"] = "Stormwind City - Lion's Rest",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:b3583c}Heather Hariston{/col}{/h1}\n\n{col:ffffff}With a head of sunflower blonde hair, and relatively fair features, Heather could possibly be considered pretty. That is, perhaps, if she cared more for her appearance. Often seen in a scruffy state, with her hair put into a lazy high-ponytail and stray strands of hair falling into her eyes, Heather is one big oxymoron.\n\nA surprisingly detailed sleeve of tattoos is easily seen along her right arm, all the way from her wrist to her shoulder. The main tattoo of her collection seems to be a large snake, the head resting at her wrist as the body winds it's way up her arm to her shoulder. Around the snake are tattoos of various animals, each one in a bronzed ink that gives it a timeless aura. These animals symbolise each type of creature Heather has successfully hunted.{/col}",
