						["AC"] = true,
						["TI"] = "Weapons.",
						["TX"] = "His glaives are always kept sharp to the touch, not as fresh as Kainzan would like to think they are, it's obvious they've seen plenty of fighting or it might be their origin is unknown even to him, their hilt is wrapped around in thin rope, going in an x formation, providing excellent grip.",
