					["3"] = {
						["AC"] = true,
						["TI"] = "Armour",
						["TX"] = "Obviously worn out, where there is cloth faintly torn, where there is plating it would bear dints, long scratch/teeth marks upon the surface, no polishing can make this better.",
						["IC"] = "INV_Leather_RaidDemonHunter_Q_02Glove",
