					["2"] = {
						["IC"] = "Ability_DemonHunter_Glide",
						["TI"] = "Imposing",
						["AC"] = true,
						["TX"] = "His very aura be it out of instict or ability to see it would make even a seasoned war veteran think twice before engaging him, his height and demonic features alone being enough to deter those foolish enough to get on his bad side.",
					},
					["5"] = {
						["IC"] = "INV_60Crafted_Ring2C",
						["TI"] = "Jewerly",
						["TX"] = "The ring is made of darkened grey metal, simple in design, the name Darkwrath engraved on it's inside, ontop of it sits a nice oval felglowing gem, shining brightly as if just recently infused with it's magic. He would usually wear it on his middle finger on his right hand.\n",
						["AC"] = true,
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Felsmithning journal",
						["TX"] = "The book is attached by a firm string, most often hanging by his right side on his weist, the book itself looking very new.",
						["IC"] = "INV_Misc_Book_16",
					},
				},
				["v"] = 71,
			},
			["time"] = 1518918530,
			["zone"] = "Stormwind City - The Canals",
			["about"] = {
				["T1"] = {
					["TX"] = "{h2:c}Physical description{/h2}\n\n{link*https://img00.deviantart.net/6dec/i/2017/340/9/b/___commission__night_elf_demon_hunter____by_shadowpriest-dafxz3f.jpg*Kainzan shaven with hair loose}\n\nKainzan is very tall for his age, which is something yet unknown to him. He towers up at eight feet.\n\nHis body is obviously well trained and toned, having a good balance between being toned and buff. A large part of his body covered by demonic tattoos, fiendish artwork glowing brightly in their forbidden felblazing might. Pockets of fel power onto his body once more inclining towards the fact how much he contains inside of himself.\n\nHis face is that of a young night elf or as much as anyone can really tell by his Fel mutations, suggesting towards the amount of fel energy he is containing in himself. His skin complexion would show cracks in his skin like scales forming, he also bears minor old scars on his face that cannot be seen from afar or even easily at a first glance. He also has a very strong jawline, resembling more of a brutish stature. The two massive horns coming out of his skull may as well suggest that they're not strangers to flesh, used numerous times as a means of a weapon as they appear incredibly thick.\n\nHe is blindfolded as to hide the Fel fire burning in his sockets, the glow of which can be seen through the blindfold, blazing with a terrifying presence of unwavering will, determination and unnatural ferocity.\n\n{h2:c}Personality traits{/h2}\nHe can be as clever and as dull, having a bright moment and perhaps followed by a dull one right after that, he is mostly controlled and under check when it comes to his emotions.\n\nRational and calm, he would often resort to sarcasm if under pressure instead of getting angry.\n{h2:c}History{/h2}\n  Kainzan is someone that have lost their memory over and over in his past. \n\nThree times to be more specific. He was born and raised to be a warrior.\n\nOther than that little is known about him as he in recent events woke up from another amnesia, finds himself washed up down the river between Duskwook and Elwynn Forest.\n\nHe made his way towards Stormwind, asking every traveller he meets on the road where the closest big city is.\n\nOverwhelmed by the big city, he roamed around confused for days, trying to fit in and interact with the citizens in order to gather any useful information that can help him recover his memory, not many were willing to talk or even look at him, making him feel more misplaced than ever.\n\n As a result, he'd find himself with the urge to return to his home travelling back to Kalimdor he would pass by Felwood on his way to Ashenvale, upon finding the corruption in the forest he decided to remain and attempt to purge anything touched by the corruption of Fel. Not long into his quest, he meets with the Moonborn. A group who'd accept him for what he is offering him to remain with them and join forces against the corruption.",
