			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-8-2:128:128}\n\n{h2:c}{col:127eff}Jocelynn Cirella Roseheart{/col}{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{col:54b8ff}Before you stands a young woman standing at 5'6 (167 cm) tall she is narrow-waisted. Her deeply blue gray tinted eyes adorned by her soft and elaborately wavy styled golden blonde hair usually wrapped in a neatly formed ponytail. She adorns an oval shaped face, little eyes, a short nose, rosy cheeks.\nHer clothes are frequently expensive and she prefers them to be darker coloured.\nShe has a quickly noticeable tattoo on her right wrist consiting of a floral wrapping made of roses twined together all the way to her pinky finger. \nA notable feature she is most likely constantly doing is her distinctive smell of strawberries which would also hint about over overal personality.{/col}{/h3}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-14:64:64}\n\n\n\n\n\n",
