				["PE"] = {
					["1"] = {
						["IC"] = "INV_Misc_Head_Human_02",
						["TI"] = "Appearance",
						["TX"] = "Jocelynn Roseheart is a young but energetic woman. Which often results in her being tired by the later times. Certainly an amusing person to behold.\n\nOne could quickly notice Jocelynn her height is slightly shorter as average for a woman of her age. Though her soft and tending to curving body would make a perfect match to her height. She is slightly underweight. Adorning a lightly tanned skin due to her love for the beach and warm places visiting them alot. She has a little birthmark on the right side of her neck which she is a little unsure about. \n\n",
