					["3"] = {
						["IC"] = "INV_Chest_Cloth_70",
						["TI"] = "Clothing/Attire",
						["AC"] = true,
						["TX"] = "Jocelynn mostly prefers the colour blue and this is noticeable at any time and almost in any kind of attire she uses.\n\nArmor:\nHer armor is made from fine and quality silk slightly reinforced with leather on the chest to give abit more protection to her vital and important organs without losing mobility. And one could guess... The main colour is blue with golden lining.\n\nCasual:\nThere is no special thing about Jocelynn her casual attire nor is she bound to one kind of set. She wears what she finds comfortable and pleasing at that time given, making her unpredictable and odd when it comes to wearing a casual attire.",
