			["character"] = {
				["CO"] = "Approach me, walk-ups are encouraged. \n\nTargeting you = IC looking at you.\n\nTheme: https://www.youtube.com/watch?v=oiRM-fRjPlE",
				["RP"] = 1,
				["v"] = 25,
				["XP"] = 2,
				["CU"] = "Most likely has a cigar resting between his left fore and middle fingers, with the right hand holding a spell-tome.\nHas a large bejeweled ring on his right hand.\n",
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:533cff}{/col}{h1:c}Aidan Blakeheart{/h1}\n\n{img:Interface\\Challenges\\challenges-plat:256:256}\n \n{h2:c}Glances{/h2}\n\nPerspicacious, Vindictive, Perserverant, Philosophical,  Opinionated... These are words in which you can describe Aidan Blakeheart, a fresh-faced young dabbler of magic, whom is led by his ambition and emotions, yet guided by his rationality and comprehensibility. He stands against those whom disagree with him, through logic and understanding despite holding an easily mistakeable firmness to his own opinion, unless of course you are talking about his allegiance, perhaps to the Vanguard, Kingdoms of Lordaeron or the Alliance, clearly somewhat of a loyalist in terms. The boy presumably scans the area with a rigid brow, and strong impervious gaze through it, perhaps eyeing you up and down - creating a first impression most likely - which he is often does (albeit a little to fast). It would be clear to see that he is somewhat of a believer of the 'Make yourself presentable' ideology, even if that is too much, with slicked, touselled short hair, a hard, sharp jawline, and a similar nose-bridge, too. His looks come across as acuate, and attractive, - which is the same for his body, too. He has muscles upon muscles through vigorous training, which may be down to the fact he thinks he might need this to progress his goals, or mentality, with a clear belief: a healthy body is a healthy mind, after all. His pecs are cut clean, as the same with his abs and obliques are. (He would bear a similar body shape to Scott Adkins; {link*https://kungfukingdom.files.wordpress.com/2010/01/ninja-1-33.png*}). Veins occupy his biceps and forearms heavily, training also with means of dynamic tension, an adopted technique,- his legs too, would be solid and rigid, down to a muscular bulk with large quadriceps and qualves, aswell as firm, large glutes.\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-1:128:128}\n\n{h2:c}Expertise{/h2}\n\nDespite his young age, Aidan would be quite the combatant, learning and applying uses of Arcane at a growing rate. He is able to perform major conjurations, and abjuration, though he places his skill of such with general uses, with it ranged attacks, or enchanting his blade to slice an enemy a hundred times more lethally. Which is also a skill he has acquired; using a blade, which he also is quite proficient in, being trained very earily, alike with his boxing, to use such a weapon (Mainly by his late father). \n\nHe undergoes numerous studies in Stormwind to increase his knowledge- now being able to adapt both fire and ice magiks to his will, even though he is an apprentice still. These skills would contributely massively to his 'expeditions' with the Vanguard, in a combat sense. \n\n{h2:c}Hobbies{/h2}\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-36:64:64}\n\nAidan is no stranger to fulfilling his indulgences and creature comforts, treating himself often to a cigar, and a cold brew or scotch. He would of acquired quite the pocket from inheritance, with his father passing, and his mother still working, - which adds ontop of a rather noble household, He is well-off, so it is clear that his goals with the Vanguard are not a mony-driven one. Despite drinking and chain-smoking cigars, he keeps a healthy balance with boxing, and general exercise, seeing the improvement in his health to be a motivation in doing so. The boxing side of things whoever, is for pride and to show-case his hardiness and resilence, both of which, he coincidentally is. \n\n\n{img:Interface\\Calendar\\UI-Calendar-Event-PVP02:128:128}\n\n{h2:c}Loyality{/h2}\n\nAidan bears an utter devote respect and following to 'his' Lordaeron, longing for the day he can walk the fine, cobbled steps once more, clearly having massive pride and reverence over his former home, now occupied by the Scourge, whom he loathes with all entirety, vowing for the day to strike them down in the most torturing way possible (even just the remnants) . His view on the Forsaken is similar to the one on the Scourge, and infact, believes the forsaken are a direct by-product of their evil, and also should be akin to the punishment in which the Scourge shall recieve, though seventy-sevenfold for their sins in occupying Lordaeron, which gives no chance for the Kingdom of Alliance to reclaim (though still believes that this day will come, 'the day of reckoning.')",
				},
