				["T1"] = {
					["TX"] = "{img:Interface\\QuestionFrame\\answer-PaladinRet:256:128}\n{p:c}Zinnadria (Zinny) Te'on{/p}\n\nLong, red hair. Deep, sapphire blue eyes and a tantalizing smile fixed upon her dark lips are only a few of the striking features this woman in her pride proudly displays. Always curiously looking around for people to meet.\n\nHer curvaceous figure squeezed into her golden armor. Despite being curvy, her body looks somewhat toned in places, her arms and legs look lightly muscular, seemingly manual labour isn't something unknown to her, or the weight of carrying her armor and weapons has taken it's toll on over the years. Her body standing slightly taller than most women from the northern parts of Azeroth.\n\nZinnandria, or Zinny to her friends, wanders from place to place, minding her own business. After the destruction of Thereamore, where she was living at the home, she hasn't found a new home since then, so she continues to wander until she does.\n\n\"Friends come and go, but there are a precious few you should hold onto\"\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n(( Very, VERY! NSFW pictures. Whisper me for lewd pictures of Zinny, for anyone interested! If you're not interested, simply don't ask! ))\n\n{link*https://youtu.be/ojchrMZZceE*Just some music Zinny has in her head.}\n\n",
