			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:a72015}IONAKA CAILARA{/h1}{/col}\n\nA noble woman, born out of Redridge, no real connections towards the Stormwind nobility, but her title is of granted land by the king to her family.\nIonaka Cailara is a woman that likes to dress herself in fancy clothing, mostly to resemble her success as both a Stormwind Mage, and within the Kirin Tor, and now she finds her fortune with the Tirisgarde.\n\nAnd when it comes to the first glance of her, one would easilly notice the long firey red hair that rolls down her cheeks and onto her shoulders, well kept and groomed at all times, and if one was to get close enough, a feint scent of lavender and strawberries could be noticed.\nHer azure eyes can easilly be seen, as they kinda stick out from the rest of her facial features, as the light tone of color does not match either the firey red locks, or those dark red lips.\n\nMost of the rest of her body is most of the time obstructed from view by long silky dresses, but it's still able to observe the woman's seemingly modest chest, but not much else is able to be observed due to choice of clothing mostly.\nIonaka usually wears silk gloves to cover up her hands, but her right hand always has a prominent signet ring, most likely related to the heritage she has.\n\n{img:Interface\\Pictures\\artifactbook-mage-felomelorn:512:256}\n\n{col:46f3ff}OOC Information - {/col}\n\nCurrently not looking for anything.\nNo longer listed in the Stormwind Mages Archive.\nNot looking for male characters... AT ALL.\nNot interested in night elves, worgen, pandaren, gnome, dwarf or draenei characters on this one, but feel free to come for a casual talk, just do not expect anything more than just a friendly chat.\nDon't be afraid to say hey, always enjoy a casual talk.\n",
