				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:cb3699}Appearance Referance: \n-Mary Stuart (Reign) {link*https://i.pinimg.com/originals/13/36/29/133629fa0c47b0acc9d6562b94898a90.png*Lara with Black Hair}  \n{col:cb3699}-Drizella/Ivy (Once Upon a Time): {link*https://cdn.discordapp.com/attachments/315828493369868290/411199025749164032/Lara_NobleDark.jpg*Lara with Brown Hair}{/col}\n\n{col:ffe17b}Come find out about her backstory icly :p{/col}\n\n{col:41d6eb}\n------------------------------------------------------------------------------------------------\nEquipment: \n------------------------------------------------------------------------------------------------\n\n-Lara is usually seen carrying around a scythe, Elune knows why she picked that as her main weapon...\n\n-Lara's boots always seem to be lined with some kind of metal, likely to pack more of a punch if she has to kick people\n\n-Necklace: The Veridian Dancer (Event Item; Referance: {link*https://www.polyvore.com/cgi/img-thing?.out=jpg&size=l&tid=57781186*Your text here}) {col:41d6eb}\n\n-What seems to be two rose thorn vines are wrapped around her wrists at all times.\n\n-Two Black Crystal Daggers always hang from her waist\n\n-Flintlock pistol always holstered to her belt\n\n-Seventeen Throwing Knives hidden all over her (10 Poison, 7 Shadow infused.)\n\n-Light Blessed Daggers (6)\n\n-A large pouch of what seems to be acorns hangs from the right side of her belt, behind her dagger\n\n-A smaller pouch filled with what seems to be...dirt? Hangs from the left side of her belt just behind her pistol\n\n-A small but sturdy-looking pouch, only about the size of four fingers rests on her belt. It's contents are not revealed easily by the looks of the pouch but they seem to be something light at the very least?\n\n-She is always seen carrying around a medium sized backpack which seems to contain a medical kit, a spare set of armour/clothes, a few potions, some food and a survival kit {/col}\n\n{col:c76fd7}\n------------------------------------------------------------------------------------------------\n Themes (Aka Playlist at this rate): \n------------------------------------------------------------------------------------------------\n-EPIC POP-  ''Stay Alive'' by Hidden Citizens (feat. REMMI)\n\n-Ivan Torrent- Human Legacy\n\n-Bebe Rexha - I Got You\n\n-2WEI - Survivor (Epic Cover - \"Tomb Raider - Trailer 2 Music\")\n\n-World's Most Epic Vocal Music: NOBODY WANTS TO BE ALONE || by Christian Reindl (ft. Atrel)\n\n-Sia - Unstoppable\n\n-The Score - Revolution\n\n-EPIC POP || ''(I Just) Died In Your Arms'' by Hidden Citizens (Epic Trailer Version)\n\n-EPIC POP || ''Let Me Out'' by Hidden Citizens (Feat. Rånya)\n\n-\"Ready For Centuries\" - Mashup of Fall Out Boy/Taylor Swift (CONCEPT)\n\n-Efisio Cross- A Sacrifice to Save You\n\n-Zack Hemsey - \"See What I've Become\"\n\n-Sia- Never Give Up\n\n-Krewella - HUMAN\n\n-C21 FX - Blood Red Roses [Lyrics - Epic Orchestral Vocal]\n\n-EURIELLE - Rescue Me [ Album ARCADIA ]\n\n-Shatter Me Featuring Lzzy Hale - Lindsey Stirling\n\n-Zack Hemsey- The Way\n\n-Hidden Citizens- Heroes Fall (Ft. ESSA)\n\n-Alan Walker- All Falls Down\n\n-Alan Walker- Sing Me To Sleep (Romy Wave Cover) {/col}\n\n\n",
