						["TX"] = "-It should be noted that her canine teeth seem to be sharper then the average humans but that is just an oddity...right?\n\n-Lara is usually seen with either Dark red hair or black hair. She seems to like to change the colour every so often.\n\n-Cartiledge piercing on right ear, a single and simple silver ring.\n\n-Lara looks quite fit and athletic, faint muscles forming on her abdomen and arms, showing that she trains often. \n\n-Lara's expression usually is given away from her hazel eyes. Whether they show happiness or sadness there is always a glimmer of hope and compassion in them even if it sometimes is very slight. Her eyes also seem to always be on the look out for anything interesting.",
