			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Well-groomed, proud and extrovert, such would be the best description for the woman currently catching your eye. \n\nCaylie, who is well-gifted in her physical attributes, stands tall at five-foot-ten. Her smooth, and from what’s visible, untarnished skin is a healthy pale golden tone. Her face itself would be rather alluring to most, possessing distinct feminine features. Her brows neatly trimmed to a thin perfection, especially accentuated when they’re perked up by her natural sly curiosity. \n\nCaylie’s eyes are comprised of an icy-blue iris, the very edge of which is a contrasting fiery green. While her eyes are otherwise brightly colored as such, they still carry an odd warmth and depth to them, likely making onlookers’ visions linger.\n\nHer nose is rather small and feminine aswell, a minor curve just under the bridge of it. Up until now, Caylie seems to have a rather slim face, but that is where her cheeks come in. With only a slight natural blush in them, her cheeks are rather full, balancing out the rest of her face. \n\nBelow her nose and cheeks rests her smile, two wide and puffy lightly red lips guarding her shiny whites, though more often than not would it be curled into a smile or grin, showing off her immaculate dentals. Her face is rounded off by her slim, womanly chin. Atop her head rests a crown of golden blonde locks, equally as well cared for as her beautiful skin. \n\nDespite this gift, Caylie prefers to keep a professional exterior, having those delicate locks of hair bought up into a bun. This shows off her small ears, each of which has a finely crafted golden hoop-earring adorning it’s lobe.\n\nContinuing downward, her gorgeously slim, long neck connects head and body. As your vision follows it down, it soon broadens outward to a set of somewhat broad yet feminine shoulders. Her upper and under arms are only gently toned and slim, revealing that she is no heavy combatant. Her hands quite dainty, seemingly receiving extra care and maintenance. \n\nContinuing down from Caylie’s well-defined collarbones, her alluring femininity comes to show. Her chest a somewhat ample size, she leaves only little to be missing, especially as her common clothing eyes frames them neatly, if not tightly hug them. \n\nDownwards is her stomach, rather slim and feminine, though more through dieting than exercise, it rounds out in a set of motherly hips however, her waist line struggling a bit to keep as slim as she might’ve wanted. Her bum, also quite well-proportioned is slim, without being flat, leaving her with a near-full buttocks. \n\nHer thighs are quite fine, working as a neat bridge between her voluminous rear and her much more slim set of lower legs, ending out in a pair of girly feet.",
