			["time"] = 1518921038,
			["zone"] = "Stormwind City - The Canals",
			["about"] = {
				["T1"] = {
					["TX"] = "{p:c}{link*https://image.ibb.co/jxjBSw/Saker.png*In-Game Representation}{/p}\n\n{col:247191}Preamble{/col} - {col:ffffff}IMPORTANT{/col}\n{p:c}{col:df66c3}Each section is intended to one day be wrote up as a set of short stories. The point of this TRP is to give a breif overview.{/col}{/p}\n\n{col:247191}Early Life{/col} - {col:ffffff}Ages 1-18{/col}\n{p:c}{col:df66c3}Alfred Saker Mach was born in (Insert Year) to Thorne and Dorothy Mach. At the age of eleven, four years after the death of his mother, Alfred was put in as a cadet for the Kul Tiran Merchant Navy in Boralus by Thorne Mach and his new mistress. Boasting an initial brilliant career as a cadet within Sir William Rowley's regiment, during which Alfred excelled in all disciplines. At his coming of age Alfred began his insubordination towards the officers.{/col}{/p}\n\n{col:247191}Shipping Out{/col} - {col:ffffff}Ages 22-25{/col}\n{p:c}{col:df66c3}After four long years of insubordination Alfred finally took himself off to new lands. According to charter records, Alfred left for Booty Bay aboard a ship called The Surman, then boarded a ship named the Awake, bound for Tanaris. The ship was captained by slavers and used for such purpose. It was rumoured that the ship sank off of the coast of Pandaria when she sailed too far off course and into the fog, never to return. Alfred was presumed dead. {/col}{/p}\n\n{col:247191}Captive{/col} - {col:ffffff}Ages 25-31{/col}\n{p:c}{col:df66c3}Alfred began trading with local tribes of the land he became marooned upon, though he would eventually circum to the unfortunate fate of imprisonment and later torture. It was during his imprisonment that rumours spread about barbaric and cruel behaviours surrounding his persona. Locals became enthralled by the tall tales and soon began to offer his captures money to allow their fighters to take Alfred on.\n\nDuring a period of four or five years, Alfred faced numerous opponents in physical bouts of confrontation, always attempting to hold his own, in fear that losing a fight would end his life. His changing point came when, after a regular match-up, his cage was accidentally left unlocked. A man of opportunity, Alfred broke free from his captures grasp and vanished into the depths of the island.{/col}{/p}\n\n{col:247191}The Day A Deadman Walked{/col} - {col:ffffff}Ages 37-40{/col}\n{p:c}{col:df66c3}Nothing is known the time that followed Alfred's escape, as he fails to recollect any details about the events that transpired on the Island. It would be five years before Alfred's name would emerge from the jungle undergrowth. He presumably had spent his years scrounging the island for valuables, this is likely as there were rumours of a man fitting his description flogging \"Ancient\" goods at markets all across the eastern seafront of the Island. This coin would aid in his eventual departure, in the form of a merchant vessel, \"Christened\" the Sweet Polly-Jayne. According to the ships logs, she set sail for Tanaris, Alfred's original intended destination, and made landfall a mere eight-months later.\n\nWith Alfred's return, his name began to circulate the lesser tiers of society as a man \"already dead\". This soon reached his home land of Kul Tiras, and with it his Father. His blood began making attempts to start discourse with Alfred, though for a myriad of years this fell upon deaf ears, until such a time that Alfred returned home to Boralus.{/col}{/p}\n\n{col:247191}Home{/col} - {col:ffffff}Ages 40-46{/col}\n{p:c}{col:df66c3}Alfred returned to his home of Boralus. Though identical in form the man who left was not the one who returned.{/col}{/p}\n\n{col:247191}With The \"Tide\"{/col} - {col:ffffff}Ages 46-Present{/col}\n{p:c}{col:df66c3}Soon enough, Alfie returned to the sea. His first voyage taking him to the Alliance capital of Stormwind. Upon arrival he began to search for a permmanant position aboard a vessel, soon coming across posters; \"Baratide Naval Brigade\" were recruiting. Alfie found his way into their ranks and began to travel with the group.{/col}{/p}",
