						["TX"] = "Siblings secret.\n{col:a9a9a9}— Look, look, you can’t blink, alright? If you blink you’ll miss it. I won’t show you again. You gotta pay attention, yes? Right. Right-right-right. Look. In three, two, one… Wait, you’re not even looking, hey! I won’t do it again. L-o-o-k. Three, two, one…\n\n… you didn’t look. Michael blah! It’s not because you’re a baby that you can ignore me like that. I’m trying to show you real things here. Bah, too bad, you’ll never know the AMAZING things he taught me. But you didn’t look, so… and you better not tell mom and dad, not that you know how to talk, anyway. Always good to talk to you, little brother.\n\nCheers.{/col}",
