			["about"] = {
				["T1"] = {
					["TX"] = "Friske is an intimidatingly hulking worgen, more akin to a monster in armor than is even typically thought of his own kin. His fur is wildly overgrown around his neck, shoulders and arms and sprawls over parts of his gear when worn, it is white and dark-grey in hue but his mane is thick and darker by comparison. \n\nHis ears are long thin and large, sitting evenly either side of his head. His eyes are crimson and sit deep-set into his skull leaving dark rings around each,   ultimately leaving him with a naturally unsettling gaze. \n\nThis is only reinforced by the presence of the large saber-tooth like teeth, the natural four canine incisors at the front for ripping and tearing flesh seemingly overly large and sharp, sticking outwards from his jaw, and when rested seem to sit comfortably against the side of his maw beside each other. \n\nHis voice is often low in tone, and carries with it subtle gruffness, and seems to lack typical indicators for judging mood, leaving his speech rather devoid of emotion aside from typical exceptions, proving it difficult to discern his thoughts and feelings on a matter by outwardly judgement alone.\n\n",
