				["CU"] = "Feeling more confident and calm than she has in a good while.",
			},
			["time"] = 1516922104,
			["zone"] = "Stormwind City - Stormwind Harbor",
			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n{h2:c}Remasa Davenport{/h2}\n\n{p:c}Remasa hails from the background of a middle classed family that treated her well and kept her safe, giving her a healthy childhood until the age of nineteen. Through a damning moment  in her life, she found herself poor and weak, forced to fend for herself in the streets of Stormwind City.\n\nLater, however, she stumbled into a ship's crew. She sought to explore the world with them, learning how the life of a privateer is, like her father before her. About three months later, she left the crew, to begin living a life of her own, staying in a room that she rented within Stormwind City.{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}[Appearance]{/h3}\n\n{p:c}Tied neatly in a ponytail, Remasa's fiery locks stands out rather beautifully and reveals a good condition. Her face looks like pure innocence and youth, yet at times a grim expression is visible, should one look close enough. Her eyes of emerald gleam are both delicately located on either side of a buttoned nose, showing her natural beauty on her face. Further down, her thin naturally red lips are shown, keeping a decent shape.\n\n\nHer slender neck leads down to a lean frame, with natural curves adorning her body with a fair hourglass, definitely not exaggerating to say the least. With an ample bust, curving down to a pair of wider hips, followed by legs proportioned well with the rest of her body in length and size. Built muscles are also starting to show, giving her appearance a slightly toned look.{/p}\n",
				},
