						["TI"] = "Appearance",
						["TX"] = "Remasa is a fair maiden of the sea, which is clearly the first impression you get with the way she walks, talks and looks. She holds onto a youthful face and physical features, with beautiful red locks adorning her green eyes.",
						["IC"] = "Achievement_Character_Human_Female",
