						["TI"] = "Armaments",
						["IC"] = "INV_Sword_30",
						["TX"] = "Sheathed within its leathery scabbard, Remasa's finely crafted rapier can be spotted. The hilt cast out of gold that reflects the sun's shining rays. \n\nAside from that, a flintlock pistol with engineering modifications is holstered on the opposite side of her rapier. It carries a barrel containing three bullet slots.",
