		["0209224531ENOCF"] = {
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["v"] = 23,
				["XP"] = 2,
				["CU"] = "",
			},
			["time"] = 1518308462,
			["link"] = {
				["Dourne-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-4-3:128:128}\n\n{col:788093}Your eyes finds a man of average height and a slim yet muscular build. He walks and moves with graceful motions in a fluid manner. He looks akin to that of a dancer. Full knowledge of his muscles, of his body. He has a handsome and strong face which is ruined by the scar running from above his left eyebrow, down between both eyebrows and then down on to his right cheekbone. It's not a very wide scar, but surely prominent. It was once deep and one can only imagine the grim visage it would have held when it was a fresh wound. Almost as if his face was cut in twain. With his short, raven black, tousled hair and his thick, burly, black beard the scar almost fits him. Those who get to know him find it odd to envision him without it. It's part of him. It is almost worse that his sapphire blue eyes amidst the dark hair draws attention to the scar. \n\nHe is adorned with dark gear made of mostly leather and cloth. Silent armour and an attire that is easy to move around in. Going for comfort rather than style. He wraps himself in a somewhat ornate cloak and a dark hood. Perhaps to somewhat hide his features. Not in the manner of which a criminal does but rather in the manner of someone who doesn't wish for too much attention. \n\nOn his belt hangs pouches of various tucked away items. Surely one of them is for coins too. Two daggers rest on the belt, sharp and ready to see combat. But a more prominent item, that he wields more than his daggers, is the pipe hanging next to a small pouch at the very front of his belt, right next to the buckle. A dark, almost black, wooden pipe. The pouch next to it, when opened or sniffed, has a scent of dried herbs mixed together. Those who're knowledgeable with herbs might recognize the various herbs as a sort of mild sedative. Surely for private use. To calm his own mind rather than use on any enemies. It also seems, if you've a keen eye, that the buckel of his belt can be opened to reveal a hidden compartment! It seems fancy but it is just a well crafted matchbook of metal. Within the beltbuckle rests nothing much fancier than matches. \n\nThere is a more lethal and dangerous side to the otherwise tame man. Within the lining of his boots and by the wrists of his gloves, sharp and short needles are tucked away within leather bands. As if able to be withdrawn quickly. Surely, they must have -some- purpose. One might wonder what. Although not many have eyes keen enough to spot these items unless they see the needles withdrawn. {/col}\n\n{img:Interface\\PVPFrame\\Icons\\prestige-icon-3-1:128:128}",
				},
				["BK"] = 1,
				["TE"] = 1,
				["v"] = 4,
			},
			["characteristics"] = {
				["RA"] = "Gilnean",
				["LN"] = "Stoneham",
				["BP"] = "Gilneas",
				["FN"] = "Dourne",
				["WE"] = "Lithe. Agile. Slim. Muscular.",
				["v"] = 6,
				["CL"] = "Oddity",
				["IC"] = "Achievement_Battleground_BattleForGilneas",
				["PS"] = {
				},
				["MI"] = {
				},
				["EC"] = "Blue",
				["AG"] = "Twenties",
				["HE"] = "Average",
				["CH"] = "7082a6",
			},
			["zone"] = "Stormwind City - Mage Quarter",
			["misc"] = {
				["ST"] = {
					["1"] = 0,
					["3"] = 0,
					["2"] = 0,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Facial features.",
						["IC"] = "artifactability_FeralDruid_OpenWounds",
						["TX"] = "One of the first things one might notice when laying their eyes on the darkclad figure known as Dourne is most likely the scar in his face. It runs from above his left eyebrow, down between his brows and ends at the edge of his right cheekbone. It's prominent yet not very wide. It's dark in color and surely when the wound was fresh, it must have looked like the face was almost sliced in twain. Quite a gruesome addition to the otherwise handsome face with sapphire eyes hidden amongst tousled raven hair and a thick, black beard. ",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "A bite worse than the bark.",
						["IC"] = "Ability_Mount_BlackDireWolf",
						["TX"] = "As some might guess when they hear he has some of his Gilnean accent left, he is indeed cursed. He is able to turn in to a hulking mass of black fur, sharp fangs and lethal claws with heightened senses and all the other benefits of a canine. Something that shows you it's him is the scar that remains in the face and the sapphire eyes that can be very recognizeable as his. However, do not fret! Dourne is a man who excericises control in all things. This includes his more beastial form. He doesn't seem to prefer it, however. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "A rainy accent.",
						["IC"] = "INV_Misc_Tabard_Gilneas",
						["TX"] = "Sometimes, Dourne makes the mistake of slipping in to his more slurry Gilnean accent. It happens most often when somewhat intoxicated or affected by his herbs. It is not that he normally tries to hide it away from the world. It is simply the fact that his time within non-Gilnean company has somewhat faded the otherwise prominent accent. Even when affected by alcohol or herbs, he seems to keep his graceful movements and the control of his body and surroundings. Not a man to become drunk out of his mind but rather one that prefers a controlled and dulled self.",
