			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}The Man{/h1}\n\nConnal is and looks like a human male, and with the typical build of an active fighter. He's fairly lean, and with an inch or so less than the average male height, he's not terribly imposing. He makes up for it with peak physical fitness, however, with clearly toned muscles and zero excess body fat. His skin colour is naturally pale, but often tanned from hours in the sun. As for scars, he has a plethora of them, both from labour and from combat, although none really stand out. Some are old, faded by time and discoloured by sunshine, and others are more fresh. He has no tattoos or notable markings on him. \n\nConnals hair is light and blonde, and without a hint of graying or receding. It's a thick mass of hair, perhaps curly if allowed to grow, which it never is. It's kept neat and short at all times, and his beard, while thick and full, is always kept trimmed. Somehow, this is always true, even in times of war and strife. \n\n{h1:c}The Gear{/h1}\n\nConnal favours a combination of plate metal, chainmail and leather, with heavy armour in more exposed or critical spots, and light or no armour at all in some spots, to allow mobility. While his armour seems ornate and beautifully decorated, it's been worn and repaired for years or perhaps decades, the decorations a faded memories of what must once have been a very expensive set.\n\nConnal favours a shortsword and a hatchet in combat, both fairly small weapons that might be unable to crack thick armour, but can be wielded with speed and precision instead. Much like the armour, they look like they were once crafted with care, skill and excellent materials, but age and use have worn them down. In addition to these, Connal is near always equipped with a single dagger at the front of his belt, and a simple flintlock pistol strapped to his thigh. \n\nOn the road, Connal packs a knapsack with the necessarily equipment, and always wears a length of sturdy rope coiled diagonally around his chest. While sailing or encamped, these items are usually absent. \n\nWhen he's not wearing armour, Connal dresses for the occasion, usually seen in either simple, functional clothing or more expensive, yet still somewhat simple outfits. He has no rings or jewelry.\n\n{h1:c}The Skills{/h1}\n\nWhile Connal is the son of a Westfall farmer, you'd never tell by his accent. He sounds educated and articulate, although speaks exclusively common. What little he knows in other languages are simple polite phrases, and his handwriting is good, but not particularly elaborate. \n\nFrom a lifetime of working on a farm or traveling as a mercenary, Connal has picked up and mastered a number of practical skills; He knows a multitude of knots, he can fight very well, and he can hunt, light fires and cook to keep himself alive outside of settlements. Although he has a rudimentary understanding of mechanics and tinkered items, he depends on others to craft these things and teach him to use them. \n\nMORE TO COME WHEN I CAN BE BOTHERED",
