				["EH"] = "55220e",
				["HE"] = "H: 6'1''  W:  8'10''",
				["CH"] = "005c0b",
				["RA"] = "Afflicted Arathian",
				["RE"] = "Somewhere deep inside Elwynn Fores",
				["v"] = 21,
				["BP"] = "Stromgarde",
				["CL"] = "Ranger",
				["EC"] = "Hickory Brown",
				["FT"] = "Arbalist || The Storyteller || Keeper of the Yak || Huntsman",
				["FN"] = "Varius",
				["WE"] = "Bulky & Muscular",
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Armor & Clothing",
						["IC"] = "inv_misc_legarmorkit",
						["TX"] = "Varius is protected by several layers of armor, varying in sturdiness and quality. His whole attire is a mish-mash of leather, plate and mail, where the strongest of the materials is used to protect the most vital areas of his body.\n\nThe armor in of itself appears to be quite expensive, but it serves its purpose well. It is decorated with fur and markings, a decorative gem is hung by a sturdy string attached to his hood, resting upon his chest. His shoulderpads bear beautiful gems embedded into the metal, as well as some decorative feathers protruding from underneath them. His belt buckle is forged out of broze in the shape of a mighty eagle, sitting amidst his many pouches and sheathes.\n\nThe armor is seemingly well maintained, and very clean. Those highly knowledgeable could tell that most of the metal used is thorium. On the tip of all his fingers are claw like attachments made from bronze.\n\n[More in-depth desc. in about]",
					},
					["3"] = {
						["IC"] = "INV_Belt_Plate_DraenorHonorS2_C_01_Paladin",
						["TI"] = "Tools & Accessories",
						["TX"] = "Fastened diagonally across his chest is a bandolier, containing Varius' miscellaneus tools and accessories. Several metal canisters with splints in them, marked with a variety of colours is attached by leather straps one after another roughly centered on the belt. Further up the bandolier is a selection of smaller and larger pouches containing varius herbs, munitions, such as darts and bullets, and a variety of other items. As well as a pair of vials with some sort of liquid inside, some green and some orange. Hanging on his belt, behind the weaponry, sits a small waterskin. Nothing fancy about it, just a plain and regular waterskin.\n\nIn a small sheathe on the belt around his waist, folded and tucked away is a one handed crossbow, capable of firing small darks. The stock is made out of oak. The metal that makes up the various components appears to be just regular steel.\n\nStrapped to his back in a holster sits what appears to be a gnomish engineered grenade launcher. There's nothing specifically beautiful or special about it.\n\nAround his neck, attached to some string sits a patch of fur, which appears to be the stump from a bears rump & a golden necklace with a magical aura coming from it.\n\n[More in-depth desc. in about]",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Weaponry",
						["IC"] = "INV_Belt_Mail_DraenorHonorS2_C_01",
						["TX"] = "Slung around his waist, in a sheathe on either side is a short-sword and a truesteel hunting knife with their own traits and adornments.\n\nHolstered on his upper body, out in plain sigh is a revolver with a chestnut stocking. \n\nThe halberd he carries is made from a dark type of wood, reinforced with metal bindings. The massive head is shaped like your average halberd, forged from a dark metal, with Arathian runes carved into it.  Various symbols and names are carved into the handle. Most are hard to read unless you're close, but some stick out: 'Duncan', 'Captain', 'Andy'.\n\nOccassionally this will be traded for either an elven looking crossbow, or longbow, both similar in style and craftsmanship, and both radiating the same aura of arcane.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["TX"] = "For the highly skilled, it would be apparant that a large quantity of wards, illusions and other protective spells has been cast upon them man. They are definately hiding something.\n(Whisper to find out if you're able)",
						["IC"] = "Ability_BossFelOrcs_Necromancer_Orange",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Achievement_Character_Human_Male",
						["TX"] = "The man has a  strong jawline and a chissled face, decorated with a long and wild bear concealing most of his face. Atop his head, a neatly trimmed and well-kept hairstyle, with short-trimmed sides and more lenghty on the top. with a tuft of hair laid lazily over his forehead.\n\nMaybe his most distinctive feature is his eyes. A deep hickory brown colour, they appear to constantly be on guard, examining those around him with keen interest. At times, when the man smiles or shows compassion, his gaze can even be described as warm and loving.\n\n---------------------------------------------\nAs a worgen the man is substantionally taller then when in his human form. His entire form covered in quite thick, soot coloured fur, giving him a bit of a fluffy appearance. Large and sharp fangs have been traded for his teeth, and now fills his maw, and long claws don his paws. His mane and beard is a mess, wild and untamed.\n\nA black, wet snout sits at the front of his face, always twitching. In a similar fashion, his ears seem to respond to most sounds, showing that he's not quite adjusted to it yet.\nHis eyes, however remain the same as before, a deep hickory brow colour, reassuring and warm.\n",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 0,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 31,
			},
			["about"] = {
				["v"] = 9,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-hunter-cover:256:256}\n\n\n{h3:c}{col:50320c}Gruff, stubborn & stern - Varius Buckley is a prime example of a soldier of fortune. Dressed for battle, and armed to the teeth, the man stands out among the citizens and inhabitants of the Eastern Kingdoms grand cities. Despite his stern and cold appearance, Varius is what one could call a handsome man.\n\nWith a strong jawline and a chissled face, decorated with a long and wild bear concealing most of his face. Atop his head, a neatly trimmed and well-kept hairstyle, with short-trimmed sides and more lenghty on the top. with a tuft of hair laid lazily over his forehead.\n\nMaybe his most distinctive feature is his eyes. A deep hickory brown colour, they appear to constantly be on guard, examining those around him with keen interest. At times, when the man smiles or shows compassion, his gaze can even be described as warm and loving.\n\nHowever he is not without markings around his body. On his left forearm, branded into the skin is the scarring in shape of the Alliance Lion. This along with a visible scar stretching from his upper back and under his arm, as well as what appears to be what remains of a scar from where an arrow pierced his shoulder marks his body.\n\nHe can also be described as broad-shouldered, with the usual muscles of a bowman,having strong arms and shoulders, as well as the back strenght. His body is toned and clearly well maintained, made clear by his armor and weaponry, which requires the man to have good conditioning and strenght.\n\nWhen needed the man speaks in a stern and commanding tone, on occassion brusque even. However his tone is usually soft and playfull, often accompanied by a grin or a sly smirk draped across his lips. \n\nOn his left shoulder, in dark ink is the depiction of the Fist of Strom, eternally engraved on his skin and proudly presenting his stromic heritage. Similarly, covering nearly his entire back is the easily recognisable Stromic eagle in black ink, with its wings spread out and talons extended. Both the talons and the beak is drawn on in a deep crimson colour, and in a small arch under said talons, is the writing 'Esarus thar no'Darador'. Directly next to it, in slightly smaller writing is the signature 'Rita xo', where the dot over the 'i' in Rita has been replaced with a miniature heart. In addition, most of his body is covered in Stromic and Arathi themed tattoes and markings, making it clear that the man is proudly representing his heritage. A circle of vrykul writing has recently been added around his bicep with the words seperated in one place by a blood-red wolf fang. Three tattooed on claw marks sit directly beneath.{/col}{/h3}\n\n\n{h2:c}{icon:INV_Bow_1h_DraenorCrafted_D_01_C_Alliance:25}{/h2}\n{h3:c}{col:caa900}Weaponry{/col}{/h3}\n{h3:c}{col:50320c}Sheathed in a stonehide leather sheathe , strapped to his back by leather bindings, is a beautifully crafted elven crossbow. Made from a sturdy wood and metal, with intricate runes and carvings embedded into its form. The masterly crafted weapon gives of an incredible kick and penetrating power when fired, it  carries clear elven traits. Where the man got it is a mystery. Accompanying this is a quiver filled with arrows directly next to it, varying in shape and use. Those able to sense magic would be able to feel the strong aura radiating from it.\n\nAttached to his belt in an equally fancy leather sheathe sits a beautiful shortsword with runes carved into the metal. The grip is wrapped in leather and a solemn gem is embedded in the pommel, glittering as the sunlight shines upon it.  And on his right side, attached to the belt by a leather hoop big enough for the shaft to slide through, but too small for the head, is a sharp axe for one-handed use and close-quarters protection. On occasion, the axe is traded for a truesteel hunting knife instead.\nFastened to the same belt as all his other accessories is a brand new revolver, resting in a holster fastened to the belt. The metal is shiny, and the stock seemingly made from chestnut. It carries no distinct traits or markings.{/col}{/h3}\n\n\n{h2:c}{icon:inv_misc_legarmorkit:25}{/h2}\n{h3:c}{col:caa900}Armor & Clothing{/col}{/h3}\n{h3:c}{col:50320c}The man dons seemingly brand new and very expensive clothing and armor. With the inner layers consisting of thick and sturdy stonehide leather under a scalemail hauberk, which to the trained eye would appear to be made of thorium. \n\nOn top of that, on his shins sits a thin plate of the strong metal guarding them from strikes, nailed onto his boots. Said boots would have a clump of metal sealed in a room at the very tip of his toes, to add strenght to his kicks and to protect his feet. \n\nEqually, his shoulderpads carry a thorium trim around the edges to strenghten it, and placed atop it is a few sharp spikes on either side. His chestpiece, ontop of being scalemail, has plates fastened to his chest to provide extra cover. The odd fur is sewn into the fabric here and there, providing both cover from the weather and warmth. The man carries a horned helmet atop his head, made from thorium like the rest of his armor.\nVarius is protected by several layers of armor, varying in sturdiness and quality. His whole attire is a mish-mash of leather, plate and mail, where the strongest of the materials is used to protect the most vital areas of his body. The armor in of itself appears to be quite expensive, but it servers its purpose well. It is decorated with fur and markings, and bears clear damages from battle, in the form of scrapes and small dents. Despite this, it is seemingly well maintained, and very clean. Those highly knowledgeable could tell that most of the metal used is thorium.{/col}{/h3}",
				},
			},
