		["[MSP]Jàckie-ArgentDawn"] = {
			["about"] = {
				["read"] = false,
				["BK"] = 5,
				["TE"] = 3,
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = ">> Feel free to approach! <<\n\n* Currently: Seems uneasy and wobbly on his feet. Probably ill! *\n\nJack Moore is the young man standing in front of you, a good looking man in his mid twenties.\n\nA rather handsome looking young man. He'd have ebony hair, often tied up into a loose ponytail, since he normally kept it quite long. His emerald green eyes were one of his more noticable features, they're bright and a beautiful color green, definitely one of his attractive features. Other than that, he seems just over 6 ft. tall, well-shaped and muscled and overall a quite good looking guy.\n\nHe wore a quite simple, cloth attire, in a dark blue color. Often not too fussed about what he wore, he finds this 'set' the most comfortable.\n\nEven though he looked good and many females \"could\" fall for him, he was often unlucky. Flirting never worked for him! Perhaps because he was more the shy type, and not too much of a show-off. Other than that, he seems like a quite polite young man. Not the kind to be extremely rude, unless he was provoked.\n\nIn his spare time, and he has loads of that, he likes to make his own candy in all sorts, shapes and flavors. Next to that, he's an excellent bake. He puts his time into creating and fiddling with sweet pastries, pies and other sweet-a-licious stuff. \n\nRelationship state: Single\n\n____________________________________________\n\nThis bit is OOC. Lately I've been having a lot of hateful, belittling, disgusting comments from people in OOC chat about my character or how I play my character. Please be advised I'll treat you with the same amount of disrespect as you disrespect me if such a thing happens again. I'd like to think I'm quite a good roleplayer after all these years and I don't think there's any need for nasty remarks. Thanks for reading!",
					},
					["HI"] = {
						["IC"] = "INV_Misc_Book_17",
						["BK"] = 1,
						["TX"] = "You might get to know through interaction with him, even though he, generally, doesn't talk about his past.\n\nEven though he doesn't like to talk about his past, many people that get close to Jack and become his friend notice there's something deep down in his heart that brings him great pain and sadness, every day ...\n\nAnd by the way, don't come up to me OOC'ly to ask whether Jack is recruitable. That's something to discuss with Jack. IC'ly. I don't metagame, nor should you.\n\nHis little sister got burned, his little brother drowned. He never met either of his parents again after he fled from a Death Knight attack in Westfall - find it out IC with him.\n\n____________________________________________\nBlacklist:\n\nNairéad\nSuttón \n(Both randomly \"farting\" on characters. Avoid these people. They're not true roleplayers.)",
					},
				},
