			["zone"] = "Stormwind City - The Canals",
			["about"] = {
				["T1"] = {
					["TX"] = "From the beginning it is clear, that this 3'10'' feet or 116.84 cm tall Gnomette takes at least some pride in her outer appearance, smooth and fairly shaped, purple mostly seen 'sweeped' hair is flipped up most of the time with a gel. Whereas it can be seen that she has a hangup of adjusting the hair, when caught in jaded mood. \n\nPassing a forehead free from wrinkles, her eyebrows being neither bushy nor thin, a smooth curve a tad darker than her hair but only -just-. Not angular nor rigid, and certainly not eye-catching. \n\n There is a chance that most do not notice the eye brows, as below such rest slightly big, profound gray tinted dark blue eyes. They squint out with reckless warmth and solace, mostly happy as if a twinkle was set near her pupils. With such gaze showing off a sturdy will and intelligence. Surrounded by small lenght blackish-lashes. The orbs seem to be leading to a straight thin nose with sassy tip. \n\nBeneath the nose, dwells naturally pink tinted lips with the usual growth the upper one is thinner than the plump-ish one below. Mostly such is highlighted in a wide majestic smile whilst showing pride in her white teeth. Tip's cheekbones are in normal height upon her svelte face and generally a faint rinse can be seen across and below them. Giving her happy and quite well-kept appeareance.\n\nTip's skin is rather tan nonetheless several strange scrapes can be seen, from the years of tinkering and other related activities. Even though the Gnomette's face might look slender her figure looks quite fit. Curves looking fully grown for a female gnome. Well fit and toned could be opportune description.\n\nA twiggy normal neck with a flappering pulse trails down to noticeable collarbones. The broad yet rounded small shoulder retain slender, but kind of muscled arms. The gnomette's wrists still looking feminine and with her hands having all fingers in place. Each is quite hardened from the smell check work of tinkering. \n\nTaking a trip down to Tip's sides, her skin covers her ribs hardly highlighting them, this might show that she is a well fed gnomette. Her body's stomach is quite firm with a low muscular structure, but nothing that is consider her unfeminine.\n\nDown from the waistline the gnomette's form curves out to typical hips with the castanets slightly prominent on the front of her body. The hips looking fully grown without major malformations. Leading down to her thighs that tones cover the rest of her following through to the long ligaments that her up, smooth and well-kept. The calves are concluded with ankles and gnome female feet. The feet still having all toes in place. \n\nIn nutshell this gnomette's well-fit aptitude hinders her feminity slightly, mixed with the kind of muscular and slim form the woman combines the swift mind with the grace of being a gnome in how she tinkers, moves and normally acts.",
				},
