		["1025171551qojHx"] = {
			["character"] = {
				["CO"] = "Looks like Kaya Scodelario\n\nhttps://tinyurl.com/CRRedwood",
				["RP"] = 1,
				["v"] = 17,
				["XP"] = 2,
				["CU"] = "Wrapped up in a warm wool robe. Content. ",
			},
			["time"] = 1519082890,
			["link"] = {
				["Confidante-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 24,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-4-3:128:128}\n\n{p:r}Priests are devoted to the spiritual, and express their unwavering faith by serving the people. For millennia they have left behind the confines of their temples and the comfort of their shrines so they can support their allies in war-torn lands. In the midst of terrible conflict, no hero questions the value of the priestly orders. \n{/p} {icon:crest_priest:25}{col:ffc73c}{/col}\n\nYouthful Innocence radiates from this young woman. A purity of soul and physical being it is hard to miss the aura of the blessed light that seems to have touched her. \nYou would be forgiven for missing the small priestess. Barely seen at a smidgen over five foot she is easily lost in the crowd of men and women of the Alliance. A slender nose and jawline enhances her petite figure. The small female often having to take two steps to anyone else's just to keep up, often walking so quickly it seems as if she trotted.\n\nGraceful is not how one would describe Cassandra Redwood, often falling from her horse when she has to dismount. Likened often to a new born fawn, still wobbly on her legs.\n\nShort in stature this northern born lass is overly curious. Often questioning as to how things work, or why something is to be done a certain way. Eager to learn and explore the world. She watches those around her with deep blue eyes. Gone was the fear of youth, now her dark gaze shows a deep determination and faith in the light.\n\nScars tell a story of a life not so idyllic as one would assume for such a young priestess. Above her left eye, mostly in her hairline a thin pink scar. Wrapped around her throat, wrists and ankles old waxy skin showed the small priestess knew pain that perhaps only few had felt.\n\nA  baker and scribe in her spare time, this little priestess seems to always have a smile and a willingness to help those that ask of it.\n\n{img:Interface\\QuestionFrame\\answer-VindicaarCrystal-LightsJudgment:256:128}",
				},
			},
