						["TX"] = "\nTaxeira is quite a tall young lady standing at five-foot six with a slim and agile build. Her youthful facial features suggest she is in her early to mid twenties. Her light brown hair falls to the middle of her back and contrasts nicely with her dark skin. Her hair is always tidy and looks really we kept. Taxeira's face looks pretty blemish-free, however she does possess some scarring on her body, suggesting she has seen at least a little bit of battle.\n\nMost of the time, Taxeira can be seen wearing plain and unassuming cloth clothes, however she can be prone to wearing something a little bit fancier now and then.",
