			["about"] = {
				["v"] = 2,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-StaticField:512:128}\n\nLong golden blonde hair, tied back in a plait if she working or in battle, shimmering strands framing her face, otherwise styled.  Violet blue eyes fringed with long dark lashes and lips that carry a rosepink hue.  A feminine shape with toned arms and legs from regular exercise of horse riding and walking, Crystalle de la Santhe (now Blacklyn)   represents a healthy and energetic young woman, who has not the frail, delicate demeanour of some of the female nobility, but a woman who is well proportioned, lithe and is content.   A soft slightly husky voice that is rarely raised in anger.\n\nUsually appearing calm and serene, she is both intuitive and astute, she is not above using these abilities to her advantage in the observation of people and her surroundings.  However, her own feelings she keeps mainly to herself and few really know her properly. A gatherer of information and knowledge in the magical arts as well as the psychology of people. \n\nEldest daughter of the Earl Selwyn de la Santhe of Oakmere Estates, Kul'Tiras, and now head of the House due to her father's ill health.  The Earl believed his daughters were to be encouraged in travel and broaden their view of the world, thus Crystalle and her sister Callistia had the opportunity to visit and study with magi from many different races and lands, after studying under the mentorship of the Kirin Tor in Dalaran.    Drawn to Transmutation and Conjuration, she has forged her own inscribed runes on her arms and hands, invisible to the eye until arcane energies are channelled through them.    \n\nRecently returned from Kul'Tiras, she is helping her cousin Jacyntha de la Santhe to run the family Company of the Hawk, as well as research for a book on Magical Arts.\n\n\n\n\n",
				},
			},
