					["1"] = {
						["AC"] = true,
						["TI"] = "Aura of the Dream",
						["TX"] = "To those sensitive to auras and understanding of the wolrd can sense the radiance of a soul that has quite frakly spent much of his life sleeping. Maybe that is why the scent of wildblossoms follows him where he walks.",
						["IC"] = "70_inscription_vantus_rune_tomb",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Form",
						["TX"] = "It seems weird that a person that has spent so long in the realm of dreams can still have a well tone body. Though he is no beast of muscles, his form is well defined, from his broad shoulders, to his bicepts stretching the leather he seems to adorne. His stride is confident and merry, as if the years do not burden the elf.",
						["IC"] = "INV_Cape_Leather_RaidDruidMythic_Q_01",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Facial Features",
						["TX"] = "For a man of his age, the elve's face is unnaturally flawless. Not a single hint of facial hair or a wrinkle can be seen, from his flowing deep purple hair to his strong cheekbones. Blazing azure eyes loom above a tight set of lips, often twisted to a kind if wise smile.",
						["IC"] = "ABILITY_MAGE_INVISIBILITY",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Horny!",
						["TX"] = "The elf has antlers. They are not very large and run mostly parallel to his violet hair but those are antlers. Are they fake? He seems to keep them in pristine condition.",
						["IC"] = "INV_Misc_Herb_Goldthorn_Bramble",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Equipment",
						["TX"] = "He carries with pride a truly ancient leather outfit, with a cape clearly made in Suramar in  times well past, when it was a heaven for magic and the arts. The mark of the Cenarion Circle is held on his belt.",
						["IC"] = "ABILITY_Rogue_ControlIsKing",
					},
				},
				["v"] = 14,
			},
			["time"] = 1518920977,
			["zone"] = "Stormwind City - Cathedral Square",
			["about"] = {
				["T1"] = {
					["TX"] = "{h1:c}{col:026330}Shando Ronolleth Shadeclover{/col}{/h1}\n\"Some in this world are heavy sleepers. They cannot wake up in the morning and when they do manage that feat, they feel like death. But this man, this Shan'do they call him, has spent the last ten thousand years asleep! Even more some tell me. And he still has students! He calls to them through their own dreams, and wakes up about once a millenium to share some words with them. Elune forguve my tongue but this is not how a teacher should teach. I have to admit though, his words once shared seem wise and enlightened. He speaks with the fluidity of a stream and wisdom of the forest. He's pleasant, those eery azure eyes often come with a warm smile on his face, which I can't say for many Shan'do. And by Elune, how does he manage to remain so fit? Some of his students are decrepit compared to him. A towering above them, with the body of a sculpture and eyes shining like a blue moon. No wonder he has his own Burrow! He even feels different, special. I find my eyes drawn to him even as he sleeps. And those antlers on the top of his head, slightly poking out of that silken, violet mane are so adorable!\"\nFrom the journal of thero'shan Silversong, deceasted by an unknown plague.\n{img:Interface\\Pictures\\artifactbook-druid-cover:256:256}",
