				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Achievement_Character_Human_Male",
						["TX"] = "Ty would stand at an average height, typical build for his line of work. Muscles would coat his body, however not causing him to look brutish, merely giving his outward appearance an intimidating look. His hair would be shaved around the back and the sides, with a decent length on top. His face would be capable of many emotions, from pure loathing to completely spaced out.\n\nIt's clear that the man is not right in the head. He often acts in a sadistic manner, taking pleasure in pain, both his own and that of others. His face reflects this joy, with a wild, toothy smile whenever he hears even a mere whimper, causing him to be a very scary man to be around.\n\nHe can always be seen in a set of armour. When requiring a hint of subtlety, he would don a purple mask, fitting to the rest of the armour he would wear, the dark brown that would outline the mask matching the chestpiece.\n\nUsually when trying his best to blend in, Ty can be seen in more casual gear, with black cloth pants, thick boots and a basic shirt.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Tattoos",
						["IC"] = "INV_Archaeology_Orcclans_Tattooknife",
						["TX"] = "Many tattoos would cover Ty's body. \n\nAll up his right forearm would be a tally, clearly tattooed by himself, and if one were to count them, there would be fifty two. He doesn't seem to disclose why he has these. On the reverse side of this arm would be a simple tattoo, of some swirling black shadows, lashing round to be seen on the inner side of his forearm too, around the edges of the tally. His left arm would be one large sleeve, composed of roses and skulls.\n\nThe shaved sides of his head would also be tattooed with skulls and shadows. The shadow tattoos would reach down to his face, running around the edge, about an inch inward.\n\nHIs back would have some dark, evil looking wings, seeming as though they had burst from his back.",
					},
					["2"] = {
						["IC"] = "INV_Sword_2H_ArtifactAshbringerShadow_D_02",
						["TI"] = "Weapons.",
						["TX"] = "Anguish and Agony -\n\nThe two blades that'd rest on Ty's back would have earned befitting names, kept in pristine condition for their next use. They seem to be your average blade, however, a slight purple hue might be seen coming off of them. \nThey're always kept with a glint to the blade, clearly pristine and sharp, cleaned to almost an obsessive level.\n\nOn his belt would also sit a simple dagger, more being seen strapped on to a harness on his chest, the required ammo strapped to his thigh.\n\nOn the back of his belt would be a flintlock, often  kept loaded, for ease.",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Substance Abuse",
						["TX"] = "It's clear to most that Ty doesn't value his health. Often stinking of herbs, smoke and alcohol, usually with a cigarette tucked behind his ear.\n\nWhen he's sober, its obvious he misses one of his pleasures, becoming quick to anger, and stressed out. He usually has a cure for this somewhere, however, be it a sip from a hipflask or a quick smoke.",
						["IC"] = "ability_rogue_smoke",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["TX"] = "His aura clearly hints at a man who has dabbled in shadow magic. Dabbled might be too light of a word, perhaps.",
						["IC"] = "Spell_Priest_DivineStar_Shadow2",
					},
				},
				["v"] = 40,
			},
			["time"] = 1518921271,
			["link"] = {
				["Tyéríck-ArgentDawn"] = 1,
			},
			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "{col:ffffff}Ty would be of an average build, around six foot one, with a muscular frame, broad shoulders and overall good physique. His body is covered in tattoos, something he seems proud of, often showing them off when he can. \n\nDespite his dangerous line of work, the man seems free from too many scars, yet does have one major one running down his right side, from just below his armpit to his stomach, slightly diagonal. The rest of his body seems lear from scars, whether just lucky, skilled or friends with a good healer is unknown to most. .{/col}",
						["BK"] = 4,
					},
					["PS"] = {
						["TX"] = "{col:ffffff}Ty would strike most as a rather strange man, often seen with a cigarette in his hand, a smell of smoke and herbs following him around. He can be seen as quite an easily angered man when things aren't going well, often to do with the criminal aspect of his life.\n\nIf one were to see the man in battle, it would seem to be a fearful sight, Ty often enjoying the battle, every second of it. He does, however, seem to be trying to become more humane every day. Despite this, however, Ty will often change completely when around those he cares, being more affectionate and caring, making sure to put those friends and lovers first.{/col}",
						["BK"] = 4,
					},
					["HI"] = {
						["TX"] = "{col:ffffff} His past is certainly something Ty doesn't talk about to anyone. He can count on one hand the number of people that actually know what shaped him to be the man he is today, and clearly isn't proud of it. Asking may not be wise. .{/col}",
						["BK"] = 4,
					},
				},
