			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{h1:c}{col:e7927d}Pamela-Jill, priestess in training{/h1}{/col}\n\n{col:f9fff1}Pamela-Jill is a cute girl from the first look of her; with her puffy cheeks, large desaturated blue eyes and plain lips, the majority would consider her to have that of a baby-face when she's not wearing makeup- which is rare. When she grins her cheeks are dimpled, and her small, silvery nose stud is pretty much always visible.  Her hair is usually kept quite neat and one can tell she is a young lady who takes pride in her appearance.\n\nHer body does not resemble that of a child however; her healthily chubby stature is graced with hourglass curves which can hardly be ignored, especially not when she's wearing her usual priestly, white garments.\n\nPJ carries herself as the kind of woman who likes to have a good time, whether that means getting up to no good from time to time or visiting friends. Overall, she's a charming girl with a little bit of edge-- though her quickness to anger can tell anyone that she's still young with much to learn.{/col}",
				},
