					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "As a worgen, Kalwyne is tall and slightly muscular. Her dark fur is soft and well-kept, while her face features pale grey patches. She was hide eyes and a small nose on the tip of her snout.  The fluffy mane on her head appears to be difficult to keep in check, seeming a bit messy in comparison to the rest of her fur. Her teeth are long and make her appear more threatening than she really is. Kalwyne's canine ears are relatively small compared to most other worgen.\n\nAs a human, Kalwyne has light brown skin with long black hair, neatly tied back. She's a shapely young woman appearing a little shorter than average, lacking the muscle of her worgen form. Kalwyne's eyes in this form are also a little wide. Her use of make-up makes her face seem more distinguished.\n\nKalwyne prefers to wear furs and leathers, eschewing traditional human clothing she used to wear. Bones, feathers, leaves and wood are all features she's adopted from the druids of the Cenarion Circle. She often walks barefoot in her human form. Kalwyne almost always smells earthy and floral, and her accent is undeniably rural Gilnean. Her demeanor is calm, friendly and often a little clueless in social situations, with jokes and innuendos often going above her head.",
