					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Appearance:\n\nA formerly full time employed Confessor of the Church of Holy Light recently turned regular volunteer; This often patriotically clad Priestess has left her Confessor duties behind for a great deal of reasons, only one of which is being burnt out regarding the Confessions themselves.\n\nShe can still be stopped in the Cathedral's proximity as a regular volunteer though, ever eager to distribute spiritual guidance when sought after.\n\nWith a greater deal of freedom though Veralique has increased the regularity of her expeditions, having taken a liking to accompany a range of her favorite squads and organizations on missions of importance where her particular set of skills may be found of use; ones focused almost entirely on that smiting the wicked contrary to the trend of focusing on healing which has seemingly never been her forté.\n\nHer personal work and projects are rarely spoken of. This self proclaimed \"Inquisitor\" tends to just answer that her tabard represents nothing more than her personal stance and interpretation of the Light's wishes which do not always allign with that of the official Church.\n\nShould one geta peek at self proclaimed and only secretively working Inquisitor then one would find her to sport luscious and thick raven black hair. With a pair of piercing blue eyes and a soft smile to go with it she is usually fairly quick to meet bypassers with a friendly smile and dip of her head yet with an uncanny ability to turn to a harsh look of misstrust in but a split second's time. Veralique has sharp facial features including her high cheekbones and a jaw offering her face a moderately angular appearance.\n\nVera is white of skin but maintains a seemingly even tan, although it’s quite subtle. Her shoulders lead down to a pair of slender arms as she is perhaps not unexpectedly not one for physical labor or melee combat.\n\nIn spite of her frequently covering tabard Veralique sports a sizable chest to say the least. Both of her breasts rival the size of her own head and appear difficult, if not impossible to contain within one’s hands or any bra of regular accessability. They're naturally tear drop shaped but with an unusual amount of perkiness for breasts of such size.\n\nThe white black and gold and partially armored uniforms hug her figure tightly at her incredibly slender waistline which almost immediately flares out widely at her hips granting her an excessive hourglass form in spite of her best attempts to hide it behind all covering cloth not unlike the matching sizeable but seemingly firm rear on top of her thighs’ back.\n\nIn comparison to her torso Veralique’s graceful legs are blessed long and carry her forward with effortless grace in spite of her thighs’ width which matches her gifted hips and in turn make her stand just a bit taller than the average of her kind but not by any excessive means should she not be wearing heels, which is rarely the case.\n\n__\n\n\n\n\n\n* Not an actively recruiting or event-organizing Guild. \n\n*This has been asked enough times to warrant a comment now: I'm not one of the Confessors who has posted on that erpconfessions tumblr thing! \n\n*If you're feeling chatty then by all means, please whisper! But be aware that I never preplan any RP. I don't judge who do though, but it ruins my immersion if you and I decide OOC where our characters are to spontaneously stumble upon one another or similar things.\n\n*Lastly I use mrp still so some sections of your TRP may be unreadable to me!",
