				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:008eff}Characteristics{/h1}{/col}\n\n{h3}{col:9300ff}Ezhar appears to be an outlandish woman, whether it be her mannerisms, clothing or the way she handles herself in combat.\n\nHer appearance has a few constants, being her red hair, personal upkeep and being always clean somehow and a pair of red lips with a natural smirk. Her clothing choice is often very light, relying on her speed and physical provess rather than protection of armor. She carries a foxhead shaped medallion at all times.\n\nHer body is hard, tense and muscular in a lean way, without an unnatural muscle definition. Her short to medium height with the lean muscular frame she has give her a certain look that not many other women share. Her legs enhance this a further, proportionally slightly wider than rest her body, one could guess she has acrobatic abilities.\n\nHer voice is medium pitched, yet, always have an authoritive tone to it with a hint of gilnean (very light cockney) accent.{/col}{/h3}\n\n{col:ff1a00}\nFor her story, I as a player refuse to write her whole story here. Some things should be discovered through RP!\n{/col}",
