			},
			["character"] = {
				["CO"] = "Cleave; Swing 2H weapon in a crit strike, dealing bleeding damage. 1/1\nViciousness; Passive +1 to Att.\n\nVoice Reference; Jenna Coleman\nTheme; Lelianna's Song - Dragon Age",
				["RP"] = 2,
				["v"] = 84,
				["XP"] = 2,
				["CU"] = "Dressed in her finest, most recently accomplished armour set. 10/10HP\n\nTired, dark circles under her eyes.",
			},
			["about"] = {
				["v"] = 21,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:204160}Lily Timpson{/h1}\n{h2:c}{col:204160}Farrier || Blacksmith || Mercenary || Brawler{/h2}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{col:204160}Appearance{/h3}\n\n{p:c}{col:83908d}As a human, Lily stands a reasonable height, not too tall, not too short. A sturdy figure with tight muscles wrapped around her frame, she has trained heavily since a child. Her wide set shoulders an asset for wielding large weapons and heavy shields.\n\nThough naturally ebon, Lily chooses to dye her locks the colour of beet, mixing her own concoctions when her dark roots begin to show. \n\nTanned skin with a faint splatter of freckles across the bridge of her nose, she has spent more time under the blaring sun, than poring over books in a library. Her high cheek bones and delicate chin contradict the rest of her stature, and though she is not unpleasant to look at, a small scowl mars her otherwise attractive appearance.\n\nBehind her piercing golden eyes, and gleeful smirk, Lily has a soft streak, only reached when you have earned her utmost trust. Until then, she can be particularly wary.\n\nUsually accompanied by her draught horse, Joey, whom she raised from a foal, and saved from the Undead advance.{/p}\n\n {h3:c}{col:204160}Wulf{/h3}\n\n{p:c}{col:83908d}In her Wulf form, Lily stands at quite a height, hulking plate armour adding to the affect. She is brutish in a fight, vicious curled claws, and fangs like daggers, ready to tear the flesh of unsavories.\n\nThis form shows her true dark side; slate greys and silver streaks dart through her pitch coloured fur, a ghostly grey mask over her face, and a long, shaggy mane of coarse hair.\n\nWith long ragged ears, and an upturned nose, Lily has an all round menacing appearance, with more tendencies of a feral than her slightly more domesticated comrades.{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{col:204160}History{/h3}\n\n{p:c}{col:83908d}Raised in a humble town house of Gilneas, Lily sought to sieze the attention of her father from her two older brothers, Jack and Peter, taking up fighting as a way to impress him.\n\nThough scolded by her mother for not being proper, Lily trained hard, taking up crude fighting skills with blunted swords and heavy wooden shields, practising with tree trunks and dummies,\n\nAt the age of eighteen, she joined the Gilnean army, under the watchful eye of her father, she quickly proved herself to be a worthy soldier.\n\nAfter the attack on the city, her whole family was afflicted with the Worgen curse, aside from her mother, who took shelter in a barrel.\n\nHer father and two brothers, at first in despair, now welcomed their newfound powers with open arms, though Lily is still in two minds about her feral abilities - her wolf form taking a large part of her personality.\n\nHaving taken up the mantle of the newest generation of the Timpson Blacksmith's, Lily has turned her attention to smithying for the odd traveller, in exhange for favours, food, and a roof over her head.\n\nShe specialises in armoury, weaponry and farriership, and you can often see her musing over her journal, blue-printing new ways to craft and temper, or otherwise shoeing horses for the Guard.{/p}\n",
				},
			},
