			["about"] = {
				["T1"] = {
					["TX"] = "{col:ffffff}Nothing to see here! Try finding out about him IC! o/\n\nMeh..while you are here, take a look at my theme songs(Or a playlist at this point)if you like!{/col}\n\n{col:ffffff}Piercings={/col}{link*https://www.polyvore.com/cgi/img-thing?.out=jpg&size=l&tid=90694364*Nipples},{link*https://www.surewaydm.com/wp-content/uploads/2017/01/men-hoop-earrings-black.jpg*Left earlobe},{link*https://images-na.ssl-images-amazon.com/images/I/21qyxeYpkCL.jpg*Tongue}\n{col:ffffff}Runic Tattoo={/col}{link*https://i.pinimg.com/736x/b8/79/6e/b8796e61241cb1e8070da4e77f72bd14.jpg*Tattoo}\n\n\n\n{img:Interface\\QuestionFrame\\answer-WarlockDemonology:256:128}{h1:c}{col:8b0005}Theme Songs{/col}{/h1}\n{col:ffffff}My Demons - Starset ||-------------------------------------|| Engine 45 - The Ghost Inside\n\nMade of Scars - Stone Sour ||------------------------------|| I'm Back - Dope\n\nThe World Belongs to Me - My Darkest Days ||-----------|| Animal I Have Become - Three Days Grace\n\nNot Listening - Papa Roach ||-------------------------------|| Breaking Now - From Ashes to New\n\nIndestructible - Disturbed ||---------------------------------|| After Me - Saliva\n\nNever Enough - Five Finger Death Punch ||----------------|| Every Second - From Ashes to New\n\nPerfect Insanity - Disturbed ||---------------------------------|| Cross to Bier - Hellyeah\n\nUndaunted - Adrenaline Mob ||---------------------------------|| Jekyll and Hyde - Five Finger Death Punch\n\nSlow Chemical - Finger Eleven ||---------------------------------|| Fight Inside - Red\n\nSuperbeast - Rob Zombie ||---------------------------------------|| Burn MF - Five Finger Death Punch\n\nCradle to the Grave - Five Finger Death Punch ||---------------|| Killin' Me - Drowning Pool\n\nResurrection - Chimaira ||------------------------------------------|| One Finger and a Fist - Drowning Pool\n\nDevil's Son - DevilDriver ||------------------------------------------|| Deciever of the Gods - Amon Amarth\n\nDefend with Violence - Throwdown ||------------------------|| Voice of the Voiceless - Heaven Shall Burn\n\nThe Enemy - Godsmack\n\n------------------------------------------------------------------------------------------------------------------\n\n{img:Interface\\Pictures\\artifactbook-demonhunter-cover:256:256}{h1:c}{col:8b0005}Event Information{/col}{/h1}\n\n{col:ffffff}Threndiel Darkrain\n\n---Combat Skills---\n\n-Weapon Training (Glaives)\n    +1 to Attack with Glaives (lvl 1)\n\n-Thick Skin\n    +2 to All Defense (lvl 2)\n\n-Brutal Combatant\n    +1 to all attacks (lvl 1)\n\n-Endurance Training\n    +1 HP (lvl 1)\n\n\n---Social Skills---\n\n-Perception +4 (lvl 2)\n\n-Athletics +6(lvl 3)\n\n---Perks---\n-Warrior's honor\n        +2 to Attack\n        +2 to Defense\n        +1 to HP\n\n-Yieldless Soldier\n        +5 Intimidation\n        +2 to Defense\n        +5 to Athletics/Acrobatics\n\n-Zealous Fighter\n        +5 to Attack\n        +4 to Initiative\n        Critical combat encounter on 19-20\n\n-Feralistic Fighter\n        +3 to attack against monsters\n        +3 to defense against monsters\n        +5 to Perception\n\n---Ability---\nMetamorph:\n+2 Temporary HP\nAttack Twice\nIf attacked by none AoE, counterattack.\n+4 defense to your bonuses\nAdvantage to: Deception and Persuasion\n\nLasts 3 turns\nStuns for 1 turn when it ends - Exhaustion\nCan be extended with a HIGH risk of losing control.\n---Flaw---\nInner Demon:\nAt the start of the event /roll 100\nWhen you extend your form, or if you reach 0 HP /roll 20 to see if you maintain control\nAnything below 20 is the demon taking over, the lower you roll, the stronger it gets.\n\nOnce you lost Control to the Demon, the DM assumes control of it.\n\n============================================================================\n{img:Interface\\ARCHEOLOGY\\ArchRare-RingoftheBoyEmperor:512:256}\n{link*https://i.pinimg.com/736x/61/5e/8b/615e8b2984870ee78a54f235ef3b0388--campaign-ideas-two-tones.jpg*The three rings on his fingers(Dramadur, Hjaldrum, Thodrom)}\n\n{link*https://i.pinimg.com/736x/4d/9e/df/4d9edf79d15bf2e82a674adeb55964a9--fantasy-faction-conceptual-illustrations.jpg*Rings when combined}\n{col:ffffff}\n---RosenHeart---\nUnawakened\nUnity, The rings of Conquest\n\nAt the start of an encounter, choose to combine or split the rings\nIf you split, choose 2 allies to get one of the rings\n\nIf split(Divide and Conquer):\nYou share initiative with the two other friends\ntaking turns at the same time\n\nAttacking the same target will give the next person +2 attack\nThis stacks untill the target is dead, or someone switches target\n\nIf one of the three with rings is targeted, the other two can agree to share the damage\n\nIf 2/3 succeeds defending AoE attacks, the remaining person will succeed aswell\n\nIf combined(Singular Path):\nGain 3 charges\n3/3\n\nFire Wave: Every enemy hit takes 1 dmg now and 1 dmg next round\nCosts 1 charge\n\nStormstruck: Deal 3 dmg to one enemy and stun them.\nIf enemy cant be stunned, everyone gets advantage to defense against it\nCosts 1 charge\n\nBoulderRush: Block the next attack made to you\nThe damage blocked can be split between enemies\nAdvantage to your next defence\n\nInitiative: +5\nWhen all 3 charges are used, your attacks are infused by a random ability decided by DM\n1-Fire - Deal 1 extra dmg next turn\n2-Storm - Deal 1 extra dmg on hit\n3-Earth - Advantage to next defense\n============================================================================\n\n---Lite Version---\nHP +2\nInitiative +4 (+5 with RosenHeart: Singular Path.)\nIntimidation +5\nPerception +9\nAthletics/Acrobatics +11\nCritical Combat Encounter on 19-20\n\nCombat Stats:\nAttacks:\n-All attacks: +9\n-Against Humanoids: +9\n-Against Monsters: +12\nRemove 1 from all without Glaives\n\n+6 Vs All(Applied)(+4 with Ability: Metamorphosis.)\n+9 Vs Monsters\n+6 Vs Humanoids\nMarks:8{/col}",
