				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}{/p}\n{p:c}{col:ffffff}---\nBefore you stands a young female of average height, with numerous striking and memorable features. One feature being her large, piercing Emerald eyes, that are made even more striking by the dark powdered make-up surrounding them and her thick eyelashes. Her skin has a surprising lack of pigment, appearing ghostly white that some even say “shimmers” in the moonlight. Alongside her pigmentless skin flows healthy, yet sometimes scraggy hair. Her hair falls rather far down her back and is never out of its ponytail and is hardly ever neat and tidy. Upon closer inspection, one may notice that Moira’s hair colour is in fact not natural. Despite the fact her hair colour often changes, subtle strands of silver hair would always be evident, even if nestled. \n\nHer figure would be noticeably curvaceous, yet toned and fit due to several years of vigorous combat. She may not be the smallest or slimmest of females, but she still uses her swift and agile movements to her advantage. Her clothing is often tight fitting against her figure and usually made out of sturdy but flexible leather. Slung over her right shoulder would be a leather satchel that hangs low by her side, seeming fairly loose and light. Latched onto her belt would be a sheathed dagger on her left hip, followed by a few small pouches with various contents. \n\nDespite her slightly boisterous nature, she's incredibly mature for her age and is always vigilant when danger is present. She is quite versatile when it comes to jobs as she has a variety of skills to use to her advantage. She has a fairly unique and distinctive accent, though it would not be strong as it has gradually mixed with the common Stormwind accent over time.\n\n((Her accent would be similar to that of a weak Irish accent.))\n---\n\n\n\nOOC Info\n\nI have just returned to WoW after a couple of months away, so I'm still trying to get back into the swing of things. Please bare with me and don't be afraid to give me any advice!\n\nThe voice I use to portray Moira's would be the character Emma Gould (Sienna Miller) in Live by Night, but weaker.\n{/col}{/p}\n\n\n",
