			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ff1326}History{/col}\nYukaei was born into a wealthy family, her parents where both highborns and her future was already planed for her and her identical twinsister Ylarìa. Sadly Yukaeì did not feel like she did fit in. She dreamt of a world outside the elven highborn society, she dreamt of being one with the forest and nature. Yukaeì decided one day to run away from her home. Leaving her displeased parents and sister behind, she studied long and hard to become what she is today, a druidess. Of course her parents did not aprove of such a thing, she was never alowed to return home ever again, and her sister hated Yuks for being so selfish. at the age of 1000 years, her mother and father passed away silently. Yukaeì was lost for a time and deep into her thoughts, she lived for many years as feral deep into the forest, til one day she decided to do something about it. She went to Val'sarah to help out her fellow druids and at that time also learned the art of healing. Which she had a natural talent for it seemed. She was soon ranked as Archdruid and was send up to Argus to help healing the armies. \n\nAnd Ylarìa she havent seen for thousands of years, the only thing she know is that she is still alive out there somewhere.\n\n{col:ff37ca}Apperance{/col}\nYukaei is rather tall for being a female, skinny yet with the natural hourglass shape,\nwith light blue shiny eyes and long silverwhite hair, She got no tattoos, or scars\nvisable. She is rather kind and calm in the begining til she gets to know people.\nOnce that barrier is broken down she is rather talk active, she know what she\nwants and is not afraid to tell it.\n\nShe prefers take the catform, since she used to travel around alot as cat,\n\nBut she likes to take her owl form to travel fast through the air\n\n{col:1d33ff}{Under construction, joined the server pretty resently, Prefer strict RP}{/col}",
