			["time"] = 1518917986,
			["zone"] = "Stormwind City - The Canals",
			["about"] = {
				["T1"] = {
					["TX"] = "With the body of a sailor, Lucent stands tall and of sturdy posture. He is lean and broad-shouldered, with an upper body hardened after years spent out at sea. His olive skin lacks any marks of defeat, instead several decorations of ink pride his skin. Out of his many tattoos, there are two that stand out as the most prominent; these two being located upon both of his arms.\n\nHis left arm has almost entirely been blackened by ink, possibly to cover tattoos that previously have marked his skin. It reaches from the top of his shoulder, down to his wrist. On the contrary, his right arm instead has the motif of a kraken, hollow and decaying with its tentacles wrapped around his right arm, these also stop at his wrist.\n\nLucent's face could easily be described as boyish, if it wasn't for his beard; which helps paint a more mature look of him. His eyes are green and his features are chiseled - a defined jaw and high cheekbones.\n",
