		["0117135229DA2pf"] = {
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["v"] = 19,
				["XP"] = 2,
				["CU"] = "",
			},
			["time"] = 1518990609,
			["link"] = {
				["Alîya-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 27,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:aeffb7}Aliya Montaine{/col}{/h1}{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:456:22}{p:c}{link*https://imgur.com/a/dZNyT*Artwork}{/p}\n{col:ffffff}Aliya is often seen with a soft smile on her lips and a mischievous glint in her eyes. She presents herself with good posture and an air of confidence, and walks with a feminine bounce in her steps. \n\nHer toned physique speaks of an active life, and her preferred armour and clothes reflect this by being practical in design. She stands taller than the average human female, and her body is slender and athletic from countless hours spent running, climbing, and fighting. \n\nHer oval face and high-set cheekbones add to her youthful appearance, and bit of eye makeup and rosy liptint enhances her natural features by bringing out the light green colour of her eyes and her full lips. A thin silver ring sits around the center of her bottom lip, and a few earrings decorate her ears. \n\nLight blonde hair falls from her scalp and down to her waist, and she's often found with her hair tied up for practical reasons. The hair carries a scent of tobacco and cinnamon and appears well taken care of, just like the rest of her appearance.\n\nAliya has a few tattoos, the most prominent one being the Kul Tiras anchor under her right collarbone. Faint scars also mark her skin, but most appear to have healed well, and aren't too eye-catching at first glance.\n\nShe often wears a few belt pouches and bags, and often carry a larger bag across her body when travelling. It's rare to see her without her sword at her hip and a dagger strapped to her right thigh. Both weapons appear cared for and are held in dark brown leather scabbards.{/col}",
				},
			},
			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "Trade_Archaeology_HighborneSoulMirror",
						["TI"] = "Appearance",
						["TX"] = "Aliya stands taller than the average human female, and dresses her toned physique in practical clothes made of mostly cloth and leather. She's slender and athletic after countless hours spent running, climbing and fighting.\n\nObviously caring for her appearance, she's often seen with a touch of makeup. Her light blonde hair carries a scent of tobacco and cinnamon, and is often tied up for practical reasons due to its lenght.\n\nHer skin is decorated with tattoos, but most stay hidden under her clothes. The easiest to spot is the Kul Tiras anchor under her right collarbone.",
						["AC"] = true,
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Shoulder bag",
						["IC"] = "INV_Misc_Bag_35",
						["TX"] = "A bag is held across Aliya's body, containing various items. The bag is shut with two buckles and has several sections inside to keep things nice and organized.\n\nThe leather has been dyed green, and the Kul Tiras anchor decorates the front of the bag, as well as the initials A.M.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Weapons",
						["IC"] = "TRADE_ARCHAEOLOGY_NOTCHEDSWORD",
						["TX"] = "Aliya carries a hand-and-a-half sword at her hip. The simple steel sword is well taken care of, and the grip has been wrapped in fine leather. A sky-blue glass stone graces the pommel as decoration.\n\nThe sword is held in a leather scabbard on the left side of her hip. It is of fine craftsmanship, and the leather is in good condition. The locket and chape of the scabbard is made out of steel and has been engraved with the Kul Tiras anchor and a rose pattern.\n___________________________________\n\nAt the right side of her belt she carries a simple dagger in a fine leather sheath with steel details. \n\nThe dagger itself remains very average-looking, and the grip has been wrapped in green-dyed leather.",
					},
