			["time"] = 1501882706,
			["zone"] = "Stormwind City",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-StaticField:512:128}\n{h1:c}Theadan Thunderstrike{/h1}\n{h3:c}What are you talking about? I am fine.{/h3}\n\n\n{h1:c}{col:ffffff}____________________________________________________________________{/col}{/h1}\n\n\n\n{h3}{icon:Ability_DemonHunter_EyeofLeotheras:25}Facial apparence{/h3}\n{col:4951b9}Infront of you stand Theadan, a tall night elf with cold eyes. His face is square formed with perfect jawlines that are covered in his thick, short beard. The elf's eyes shines in silver and will look upon you with a cold and bored look. His expression over all is more or less pure boredom, but don't let that fool you. From time to time the elf is actually smiling and it's a beautiful smile with suits him quite well.\nTheadan is missing half of his left ear that seems to have been cut off. \nThe elf has long, blue hair that he keeps in a pony-tail. The hair goes down to his waist, it looks and feels soft. Theadan usually wears a hood that covers his hair and face up as he is not the biggest fans of big crowds.{/col}\n\n\n{h3}{icon:spell_shaman_Improvedreincarnation:25} Body {/h3}\n{col:4951b9}Theadan stand 2.25 meter tall with a thin but muscular body. He is more of an athlet rather than a brute. His arms are slightly bigger from the rest of his muscles. This is very suitable due to his two sleeve tattoos on his arms, covering both arms. His right arm has an owl, sitting on a branch that is surrouned by a night sky. The left arm is a wolf, howling to the moon. \nTheadan is often seen in leather outfit with sleeveless shirt to show off his tattoos, but he also wears it for better movement in combat.\nIn his belt rests two bigger blades and around the whole belts lies smaller throwing knives. There would be no other visible weapon on his body\nExpect from his missing ear, there is no other scar on his body. {/col}\n",
