			["about"] = {
				["T1"] = {
					["TX"] = "{col:2cda77}It's hard not to notice Oriana when she passes in the street.\nOne reason is her gigantic, fat and overly friendly dog who will approach just about anyone for the off-chance of an ear scratching or a treat.\nThe rest of the reasons are her intriguing looks and demeanour. A city girl born and bred, she traverses the streets of Stormwind with an easy, unconcerned air. Boyish in figure and manner, she appears to be one who eschews makeup and \"girly things\", putting more effort into ensuring her rifle is oiled and ready.\nHer expression might easily intrigue as well, as she seems entirely unimpressed with the world around her. A lean figure and a lean face, unblemished and beautiful bronze skin framed by thick, well-cared for hair. (Yes, well-cared for. A girl has to have some inconsistencies after all{/col}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}",
