				["T1"] = {
					["TX"] = "Lower body:\nHer waist is a bit wide, nothing to big but big enough to show quite the womanly features, with her thighs being a bit thicker and muscled to compensate.\nHer lowerlegs are the same with her thighs, a bit trained but nothing overly much to the point where she would not appear womanly.\nHer rump appears to also be well trained, with it being slightly larger then a normal sized rump.\n\nTorso and belly:\nBoth her belly, chest and schoulders are rather wel trained and showing some muscle, no sixpack is shown and neither would it look like she is trying to look muscled.\nHer belly flat and the tone of her body well shaped to the point where she has a nice hourglass pose, as her bust is around a 90 Dubbel D cup.\n\nArms:\nBoth of her arms are like the rest of her body, well trained and shown to be kept that way.\nA bit of muscle though nothing to massive with her lowerarms being rather normal compared to her upper arms.\n\nBody overall:\nHer body appears to be kept in top shape, though with the hourglass figuere and her bust and rump, as well as her thighs makes for quite the womanly look.\nAppearing to be proud of her body as well.\n\nFace:\nBeing well rounded with a bit of a oval shape to it. Her nose being a bit small and perky while her lips being a bit darker color then her skin.\nHer hair is a bit longer then schoulder lenght while it has a nice bright white color and is tied in a pony tail, as her eyes appear to be bright blue..\n\n\n\n\nHow my char looks: --->>18+<<---\n{link*https://cdn.discordapp.com/attachments/399065974109634560/399066194495275018/browse-1514202976p48lc.png*Your Char looks}\n\nMy chars hair color\n\n{link*https://cdn.discordapp.com/attachments/399065974109634560/399066617629114378/JPEG_20180102_204051.jpg*Hair color}\n\n\n\n\nIgnore list.\n\nCelvirara: For shunning peoples rp. also for useing void out in the open infront of a lampost and a tavern. icly they definitly would of got caught by guard/killed\n\n(my reminded not on ignore)\nIlyurea Moonwisper.",
