			["zone"] = "Stormwind City",
			["about"] = {
				["T1"] = {
					["TX"] = "{link*https://www.youtube.com/watch?v=SV6pvII1eFU* Theme: Nothing More - Don't Stop }\n\n{link*https://i.pinimg.com/736x/b8/79/6e/b8796e61241cb1e8070da4e77f72bd14.jpg* The shape of the runic tattoo, she has carved on her chest }\n\nDisclaimer: Glaives are not artifact. :3\n________________________________________________\n\nEvent sheet:\n\n---Combat Skills---\n\n-Weapon Training: (Glaives)\n    +1 attack (lvl 1)\n\n-Brutal Combatant:\n    +2 to all attacks (lvl 2)\n\n-Endurance Training:\n    +1 HP (lvl 1)\n\n---Social Skills---\n\n-Intimidation:\n    +2 (lvl 1)\n\n-Perception:\n    +2 (lvl 1)\n\n-Athletics/Acrobatics:\n    +4 (lvl 2)\n\n---Perks---\n\n-Investigator\n    +6 Perception\n    +4 Survival\n    +2 Intimidation\n\n-Piracy\n    +4 Intimidation\n    +4 Athletics/Acrobatic\n    +3 Attack\n-Warrior's honor\n\n    +2 Attack\n    +2 Defense\n    +1 HP\n-Yieldless Soldier\n\n    +5 Intimidation\n    +2 Defense\n    +5 Athletics/Acrobatics\n\n---Ability---\n\nFelhound - Enter Metamorphosis:\nGet +2 Temporary HP\n+6 points (Can be split between attack and defense)\n\nDrain magic, stuns the magic user for 1 turn  (If not stunnable it deals 2 damage).\nAnd Tei'riel will have Advantage on her next attack after that.\nCombat may be stopped with an intimidation roll.\n\nThe form lasts 3 turns\nCan be extended with a VERY HIGH chance of losing control\n\nCan be used 1 time per encounter\n\n---Flaw---\n\nInner Demon:\nAt the start of the event /roll 100\nWhen you extend your form, or if you reach 0 HP /roll 20 to see if you maintain control\nAnything below 20 is the demon taking over, the lower you roll, the stronger it gets.\n\nOnce you lost Control to the Demon, the DM assumes control of it\n\n---Lite Version---\n\nHP: +2\nPerception: +8\nSurvival: +4\nIntimidation: +13\nAthletics: +13\n\nDefense: +4\nAttacks: +7 to all (+1 /w glaives)\n________________________________________________\n\n(6 marks.)",
				},
