				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Horns/Tattoos/Weapons",
						["IC"] = "Spell_Fire_FelFire",
						["TX"] = "Her horns are strong and looks exactly like you see them.\n\nHer body is covered in green tribal-like markings, to keep her demon within contained.\n\nShe is always carrying her weapons. She prefers glaives, and both are very well taken care of. She keeps them close at all times.\nSeveral spikes can be seen on her glaives, used to hack into her enemies, leaving nasty stab wounds aside from the slashing.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Bag",
						["TX"] = "She is carrying a small bag, containing a few of her belongings.\n\n2 daggers\n3 vials\n3 fel crystals\n1 chain\n1 shard\n1 medallion with a special symbol.\n\nA broken barbed arrow, with a small note attached to it.\n\nA long, wooden whistle, of some sort.\n\nA small box, locked and warded, containing something very special.",
						["IC"] = "INV_Misc_Bag_07_Green",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Runic tattoo",
						["TX"] = "She has a runic tattoo carved into her skin, it is carved on her upper chest, right above the ribcage, between the collarbones and right below her throat. Just above her breasts.\nThe carving is colored black and it is shaped with the letter T surrounded by a dragon around it.\nThe runic tattoo emits shadow energies. (Check About for reference)",
						["IC"] = "70_inscription_vantus_rune_tomb",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Inner demon",
						["TX"] = "Felhound. Other demon hunters would be able to sense it...? Or those with other kinds of true sight.",
						["IC"] = "INV_FelHound3_Shadow_Fire",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Injuries and scars",
						["TX"] = "Bite marks on her right leg, left arm and all  around on her back. Not regular bite marks. Looks like they were made by some kind of nasty ass big insects, or some sort of silithid bug creature. (Recent)\n\n Several bitemarks around the left side of her neck. Marks from deep digged fangs and deep raking marks aswell. (Recent+)\n\nBullet wound in the right side of her waist. (Bullet is out) (Recent++) (Enhanced healing)\n________________________________________\n\nPermanent scars:\n\nA slightly visible scar on the back of her neck. It looks like a bitemark and is usually hidden under her long black hair.",
