				["TE"] = 3,
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "---Head---\nLoki adorns on her head a thick length of red hair which reaches down just past her shoulders. her face is unblemished by scars of any sort.\n\nHer eyes are an arcane blue. if one were to look closer they might see that the colour swirls around very slowly as though they were a thunder storm. whether this is due to a large amount of arcane power or just merely a visual effect is uncertain.\n\n---Upper body---\nOn her  left arm is a red tattoo that runs from her shoulder to the bottom of her arm. seeming to be scribed in various old runes (a Rune master or someone who fluent in reading runes would know that the tattoo is  infact a poem of some sort)\n\nShe has an almost hour glass figure which a big chest set. However, this hour glass figure is ruined by the healthy layer of chubbiness that rests on her tummy and her sides. Giving her a soft and squishy appearence.\n\nOften or not her clothes often take advantage of her body frame by either being tight to her body or pushing her chest up\n\nAround her neck would be a silver chain with a pendent, in that a dull blue looking stone \n\n---lower body---\nsticking to the almost hour glass figure theme. Loki has slightly broadend hips which in effect gives way to larger. rounded parts of the body. Her legs are long and slender making her out to seem quite tall (maybe taller at a distance than she actually is).\n\n Her robes and dresses are often fashioned to be slightly tighter to reveal a better view to the imagination in certain places. Trousers are often made of fine materials for her such a silks or velvets and would be designed to show the shape of her legs\n\nAround her right ankle would be another tattoo. it would be that of a blue band with nine circles in the band. each circle having a symbol within it \n(a skilled illusionist or a knowledgeable scholor would see these as something to aid with illusionist spells)\n\n---Voice---\nWhen Loki speaks she will often speak in a tone that suits her needs or what she intends to achieve. Her words are always clear and well spoken. But not so well spoken that she would sound posh.\n\nhttps://tinyurl.com/ybgxt4u5",
