		["1208214108Z8scx"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Dragons Tooth Dagger",
						["TX"] = "Fashioned Brutally into that of a Sharp edge'd Dagger, This mighty symbol of Defeat for that of a Elder Dragon-kin was the feat of one of Brynjolf's Acomplishment's up North, Taking on his first Drake in combat and taking the Tooth as a Prize for His Victory. \n\nThe Hilt itself is wrapped in the Scales of the Drakes Skin, While the Jaged Tooth remain's Sharp as the day it was in the jaw's of the beast\n\n--------\nx2 Damage Against Dragon-kin.",
						["IC"] = "Ability_Mount_KorKronProtodrake",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Heavily Musclar Body. ",
						["IC"] = "Ability_HanzandFranz_BodySlam",
						["TX"] = "You get Strong guys, That's a normal thing, But this, This is Abnormal, His muscles are Toned in the fashion of a true Warrior, Biceps Pumped, and Pushing against the Armour itself. \n\nWith his Apetite in food being almost as big as his love for Combat, His weight is doubled is average. Making him almost a China Shop Terror\n\n------------------------------\nChest Scar\n\nUnder-neath the Layers of Plate Is his Bare fur and Skin, But direct above where his Left Lung would be, Is the distictive Scarring of a Axe wound, Fresh",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Bone Armour",
						["TX"] = "If Not noticed straight away, you will soon realise that Brynjolf's armour is littered, and Welded together with that of Bones. His very Shoulderguards are Fashioned with that of Wing bone's to give a Truly Terrofying looking upon All Dragon-kin.\n\nHis Hood, The Very Leather that he skined from a Dragon's Head, Has Two metal shaped Horns, to represent the very hatred and dismissle of care to those he slays.\n\nThe Stories this Armour on it's own could produce, would be that of a thrilling story, no?",
						["IC"] = "INV_Helmet_Plate_RaidWarrior_K_01",
					},
					["5"] = {
						["IC"] = "INV_Bow_2h_Crossbow_PVPCataclysmS3_C_01",
						["TI"] = "Huntsman's Crossbow",
						["TX"] = "The Last Remaining Crossbow of the Huntsmen's Accord hangs nicely Beside Druwvur, A sight to be saw. It's Metal Layer's carved and Engraved with each of the Names for the Forefather's of the Huntsman, and a Dragon's Jaw at the very end or \"Muzzle\" .\n\nAttatched to the side of the Crossbow are Three Clipped on Arrow Holder's Used for Quick Reload's at a steady Pace. \n\nUsed rarely to down or even Kill a Airborne Drake/Dragon-kin, It stills show's signs of Use in combat, With the Wood chipped in certain spots, and the metal dented on the stock, this is still a remarkable Crossbow.\n\n",
						["AC"] = true,
					},
					["4"] = {
						["IC"] = "INV_Sword_2h_DeathwingRaidDW_D_01",
						["TI"] = "Druwvur - Ogre's Bane",
						["TX"] = "A spitting image of the Reign of the Ogre's in Feralas,  The very Beacon of Anger that every Ogre recieves when bearing their eye's upon such a weapon, Druwvur, The Ogre's Bane.\n\nTorn from the Clutches of a Ogre Lord During a Fight on the Outskirts of Feralas, Brynjolf's Day's have been counted down, ever since the day he claimed this Sword.\n\nIt's edge very different then the Dragon Tooth, Worn, Beaten and blunt, This Tool showns no sign of \"Honor\". The Destroyed Symbol of what would be considered a \"Relic\" Is merely a Tool of Destruction in the hands of Brynjolf. \n------------------------\n5+ To roll Against Ogre's. \n\nBut give's Target x2 Their Attack hit, Due to Enragement.",
						["AC"] = true,
					},
				},
