						["TI"] = "Silent ",
						["TX"] = "Arathriel doesn't speak much, he prefers observing and watching what goes on around him. However, he tries his best to come across friendly. He has some social anxiety with others. He has managed to improve on this, working on his ability to present himself well, especially when leading. ",
						["AC"] = true,
