					["4"] = {
						["AC"] = true,
						["TI"] = "Veteran ",
						["TX"] = "Arathriel is an Illidari veteran, serving in the broken Isles and on  Argus. He has previously helped with initiate training and commanded a small force in the Suramar relief efforts. Arathriel has military experience and will command and conduct himself accordingly during campaigns.  ",
						["IC"] = "Achievement_PVP_A_05",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Temper",
						["TX"] = "Arathriel is naturally aggressive. This trait picks up rapidly in spars and battles. He relies on this to feed his inner demon. Arathriel will taunt his opponents, over time doing anything it takes to achieve victory. \n\nArathriel is quick to anger and will become reactive over time. As his temper builds, he would be less inclined for pleasantries. Impatience is also a clear feature, naturally growing annoyed when being made to wait. This is reflected by his need to focus on inner battles when unnocupied by battle and duties. ",
						["IC"] = "Ability_DeathKnight_NecroticAura",
					},
					["2"] = {
						["IC"] = "Ability_HanzandFranz_BodySlam",
						["TI"] = "Appearance",
						["TX"] = "Tall, athletic-lean with a handsome face. Small bumps are seen on his back and head under his hair, perhaps something used to be here? His eyes are neatly hidden behind his blindfold which also hides bad orbital scars. To the average person it would appear that he is simply blind. Under his armor are Illidari runic markings, typical to the nature of his inner demon. This is rarely visible and would appear as simple tatoos, those magically sensitive would note faint hints of weak fel. \n\nArathriel is usually more reserved, though due to fulfilling leadership roles in his later life, he comes across calm and confident. He is fairly conservative and protective of his people. His personality will come across when meeting him. Otherwise, good-natured and dynamic. ",
