			},
			["zone"] = "Stormwind City - The Canals",
			["misc"] = {
				["ST"] = {
					["1"] = 0,
					["3"] = 0,
					["2"] = 0,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Direblood",
						["TX"] = "Obvious from her size, the runes around her eyes, and the eyes themselves, amongst other things.\n\nDirebloods are augmented humans, altered via ancient, and powerful, haemomantic ritual. Infused with the essences of beasts, they are designed to be hunters of powerful adversaries, such as demons, undead or giants - monstrous creatures.\nThey posses the following attributes:\n\n- Better senses (hearing, smell, sight)\n- Higher resistance to disease and poison\n- Higher resistance to physical damage\n- Increase in size and strength\n- Increase in speed and agility\n\nOften visible are more bestial attributes, such as:\n\n- Claws\n- Bestial teeth\n- Excess bodily hair\n- Crimson, glowing eyes",
						["IC"] = "Sha_Ability_Rogue_BloodyEye_nightmare",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Currently Equipped Weapons",
						["TX"] = "[Diryfel, Bloodbound Reaper]\n\n\"A keenly edged blade formed of sharpened, hardened mithril, the sides engraved with blood runes. It sits atop a long pole, that ends in a hooked balance.\"\n\n+5 Damage to humanoids\n+5 Damage to beasts\n+2 Damage to dragonkin\n+2 Damage to giants\n\n<(=)> Rune - Bloodlust (chance on hit to increase haste by 3)\n<(=)> Rune - Lifedrain (chance on hit to drain 2 of target's health)\n__________________________\n\n[Gwynhaef, Lightbound Reaper]\n\n\"A sharpened blade of truesilver, emblazoned with holy runes that surge with power. Hoisted atop a sturdy pole that ends in a sharp hook.\"\n\n+7 Damage to undead\n+6 Damage to demons\n+4 Damage to worgen\n+3 Damage to void beings\n\n<(*)> - Rune - Smiting (chance on hit to inflict 15% base damage as holy damage)\n<(*)> - Rune - Radiance (chance on hit to empower the wielder with a shroud of light, dealing holy damage to melee attackers)\n__________________________\n\n[Calon-o-Gwr]\n\n\"A small, one-handed repeater crossbow, compartments to store racks of bolts to bve fired as well as coating oils, poisons and other utilities.\"\n\n+2 Poison damage\n+3 Piercing damage\n+2 Bonus vs. armour\n+3 Bonus vs. unarmoured\n+1 Elemental damage\n+1 Damage vs. humanoids\n+2 Damage vs. beasts",
						["IC"] = "INV_Polearm_2H_TitanArgus_D_01",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Currently Equipped Armour",
						["TX"] = "<<Autumn Rose Champion's Armour>>\n__________________________\n\n[Autumn Rose Champion's Cuirass]\n\n\"A silvery-blue steel breast and backplate, resting atop a short scalemail hauberk. Resting on the shoulders are silvery-blue pauldrons engraved with the imagery of black magics, and of the Black Rose.\"\n\n+8 Resistance to blades\n+6 Resistance to hammers\n+5 Resistance to ranged\n+5 Resistance to elemental\n+3 Resistance to arcane\n__________________________\n\n[Autumn Rose Champion's Greaves]\n\n\"A pair of simple cloth pantaloons, durable but light. Atop these sit silvery-blue steel plates.\"\n\n+3 Resistance to blades\n+2 Resistance to maces\n+3 Resistance to ranged\n+3 Resistance to elemental\n+5 Resistance to arcane\n__________________________\n\n[Autumn Rose Champion's Gauntlets]\n\n\"Heavy steel gauntlets that protect up to the elbow, fingertips exposed and the metal stained a deep, royal purple.\"\n\n+1 Resistance to blades\n+1 Resistance to maces\n+5 Resistance to ranged\n+1 Resistance to elemental\n+1 Resistance to arcane\n__________________________\n\n[Autumn Rose Champion's Sabatons]\n\n\"Light steel boots that come to the knee, and stained a deep, royal purple. Gives good resistance to damage while also allowing maneuverability.\"\n\n+1 Resistance to blades\n+1 Resistance to maces\n+5 Resistance to ranged\n+1 Resistance to elemental\n+1 Resistance to arcane",
						["IC"] = "INV_Chest_Plate_RaidDeathKnight_L_01",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Lorelle's Visage",
						["TX"] = "It's obvious from first looks, Lorelle is a direblood, if one is familiar with them.\n\nHair is showing signs of grey, raven locks blemished by the heirs of age.\n\nA faded, but still very noticeable burn scar adorns itself upon the right side of the direblood's face.\n\nEmblazoned around the left eye is a rune, the Witan rune, one that allows the huntress a 'sixth-sense' when activated.\n\nMany scars adorn her skin, some faded, some fresh. They are all of various sizes and depths. Claws, teeth and blade.\n\nHer teeth are sharp and more akin to a beast's than a humans, her eyes an eerie red, pupils near-impossible to see, hidden behind a crimson glow.",
						["IC"] = "Ability_Rogue_BloodyEye",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Runes",
						["IC"] = "Spell_Mage_RuneOfPower",
						["TX"] = "[Witan, the Mark of Truesight]\n\n\"A rune around the left eye that allows the user to see through illusions, as well as detect traces of magic.\"\n__________________________\n\n[Kauno, Flame Pattern]\n\n\"A rune emblazoned into the right hand, allowing the user to send a blast or concentrated wave of fire at the target.\"\n__________________________\n\n[Isa, Frost Pattern]\n\n\"A rune emblazoned on the left hand that allows the user to send a wave of ice at the target, chilling and slowing them.\"\n__________________________\n\n[Algiz, Mark of the Great Bulwarks]\n\n\"A rune emblazoned over the heart, allowing the user to shield themself against a single strike of melee, range or magic nature.\"\n__________________________\n\n[Uruz, Landslide Pattern]\n\n\"A rune emblazoned into the feet, allowing the user to slam the ground, sending a wave of force around them in a small radius. knocking away opponenets or objects.\"",
					},
				},
				["v"] = 34,
			},
		},
