				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-TrollVoodooDoll:512:256}\n\n{link*http://imgur.com/LiqyoMp*Evie Reed Portrait - Commission}\n{link*http://imgur.com/Z9IJuje*Evie Reed - Commission}\n\n\nThis individual existed whether acknowledged or not. With her uninfluential existence came a beauty that was often overlooked by Human society. A young female thriving into her late twenties, Evie Reed was not so common by societies standards. Led astray by a single father she set sail from young and embraced the seas alongside him, traveling from location to location without end until recent times: in which she found solace in the city known as Stormwind. \n\nHair of peculiar nature held, fixed, firm and kinky curls that waved about her scalp like disobedient waves of the ocean, ending just past her shoulders. Frizzy and wild in it's nature, she possessed a weathered mane that was unique and seemingly exclusive to only her. The keratin that was essentially her hair in all it's glory remained  uncombed, untamed and most of all: unmatched.\n\nHer nose was often sighted as something strange for someone of her ilk, a  small curved nose which flared up ever so slightly at the nostrils similar to the Northman that inhabited the likes of Redbridge mountains. Her nose was adorn by a gold ring that was pierced into her right nostril. \n\nHer eyes were a darkened green hue, which proved to be only the works of a genetic mutation. The melanin within the pigmentation within her eyes, she lacked as most with her skin colour possessed a hazel or brown like colour. In this case she was a rare sight.  \n\nLips of buxom quality, puffed, pronounced and quite thick, her lips proved to be of cushiony quality. \n\nHer complexion was approximately two shades lighter than arboor wood, unblemished skin with some light freckles dotted about the midst of her face and ending at her pineal gland. Smooth, soft skin that surpassed the feeling of any silk or velvet textures, her complexion remained untested by the natural causation which was aging.  A true testament to her predecessors that came before her matched by no other. \n\nSlender she stood when in categorisation, but she had curvature to her form. Less announced, but welcoming curves that would beckon the thought of men and women alike whom passed her and witnessed the fabrics that embraced her skin. A small percent of body fat, which did well to accentuate her physique and with a natural speedy metabolism her stomach remained flat with soft definition.\n \nHer waist acted as a concave as it inclined within itself to a pleasant degree, only for her hips to flare outwardly, blooming and painting the plain picture that she was indeed ready to bear children. Needless to say that her posture was always straight and her gait was always upright and careful. \n\nHer rump was very firm in it's form, harder than most with softer curves. Strength is what this projected. However, as it was not as soft, it sure was wide and boastful. \n\nShe stood at a decent height for a Human female, five foot six inches high with decent legs. Her thighs were strong, build to carry her distances.\nHer feet were sized at a meagre but average size five.\n\n-Courtesy Zack Dixon AKA (Dakarmi Mo'orune)",
