			["about"] = {
				["T1"] = {
					["TX"] = "This mans eyes seems to be brown in colour, aswell as his hair and facial hair is black. He seems to have a quite scar under his left eye, who it seems that what ever did it just by inches missed the eye.\nHis face looks torned by old scars and cuts, as it looks like he has been through alot. His top right ear appears to be missing, as right now nothing is there. Looking like something bit it off.\n\nHis body is muscular although not overly done like some plate users, but he sure still has muscle enough. he appears to walk rather casually, yet seemingly to be on his guard all the time. As if he was ready to be jumped at any given point. Under his armour, above his left part of his chest, is a long scar probably made by someone sword and right on his right shoulder is there a bite mark. yet he appears to not show it too people. \n\nHis attitude seems relaxed and he appears rather quiet, not saying much although he observes much, normaly seen with a wolfhead upon his head. Making it hard to see where his eyes are focusing on. When he speaks. His voice is quite deep and graveled.",
