			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Appearance:\n\nAros has an average build, neither tall nor short. He stands up in a very straight-backed manner, and carries himself around with an air of distinct etiquette and class which would bring to mind that of a fencer. He has sharp, stark, green eyes and sports long, black hair, which he ties in a tail when he is out in his informal wear. He has a well-trimmed goatee and it is evident that he grooms himself regularly, as personal hygiene is always a priority to him.\n\nHis attire depends on where he expects to be. Whenever he is in the Royal Court of Stormwind, he would wear clothes of the finest fabrics, with an embroidered crest of House Avell on the lapel. He always wears his signet ring with his House’s crest etched under a sky sapphire. \n\nAros always carries with him a tome known as the Codex of Avitus and a hard-leather pouch tinkling with crystals which hangs on his belt.. Since his sword Voidrend was shattered in battle with the Dreadlord known as Baphiteroc, Aros magically summons his new sword instead of carrying it with him as it is rather cumbersome and unwieldy. His new sword, Voidgleam, was created from the fractured remains of Voidrend, infused with magical essence to fuse into its new form. Its apprearance is jagged and is far too large to be used in melee combat, instead Aros uses it as a conduit for his spells. Still made of voidstone, it has the ability to entrap demons inside, coercing them to do its wielder's bidding.\n\nOne can note that Aros has a sunny disposition. A man with a good sense of humor that smiles broadly when happy, with clean and untarnished teeth, indicating that he spends a lot of time grooming himself. However, Aros's friendliness can quickly turn into serious animosity when he or his companions are threatened.\n\nHe hides the fact that he's a worgen and a warlock whenever possible, especially so when around nobility and royalty who are not familiar to him.\n\n((Background and History on: {link*http: