				["Miará-ArgentDawn"] = 1,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n{h2:c}Miara White{/h2}\n{p:c}{col:ffffff}_________________________________________________________{/p}\n\n{link*tinyurl.com/miarawhite2*Reference picture}\n{col:ffffff}{h3}Overview{/h3}{/col}\n{col:ffffff}Miara seems like a young, calm and kindhearted worgen at first sight. Altough she usually strains from keeping long eye-contact with anyone, her bodylanguage shows it's probably due to a slight shyness. Luckily for her, she often carries around a book to nose in. In most cases however, she can't look away for very long, as she's curious to most people she comes across.\n\n\n{h3}Face{/h3}\n{col:ffffff}The ears on Mia's head stand out most, compared to the rest of her facial features. Due to their size, even the more subtle movements are made obvious, making it easy to tell to what she's paying attention to and how she might feel at times. \n\nThey're accompanied by a sleek jawline and curious, blue eyes. Her maw is usually kept shut, not showing any teeth up until she smiles. Her face is free of scars and bruises, and the fur pattern seems neatly colored still. {/col}\n\n\n{h3}Body{/h3}\n{col:ffffff}Mia has a slim body, quite thin, but clearly she's still eating enough. She stands a little less tall than average for her age, but seems healthy all around. Nothing out of the ordinary.  {/col}\n\n\n\n{p:c}{col:ffffff}_________________________________________________________{/p}\n\n\n{h3}Story{/h3}\n{col:ffffff}Before -and- after being cursed, Miara always seemed to favour reading above anything else. After the attack on Gilneas she was rescued by the elves, together with her only family; her mother, Miranda.\n\nUnfortunately, Miranda fell fatally ill after her rescue. After only a few months, Miara was left alone without any family or home. For a brief time, she resorted to stealing to get by. Eventually she met with another worgen of her age, named Ruben. She was offered shelter in a little house in Duskwood, where Ruben lived together with his father, Sam.\n\nOne day turned to one week, and one week turned to one month. Soon enough, the Goodwin family had taken in Miara as one of their own. Through their help, Miara was given a family once more.\n\nSince her mother's passing, Miara has promised herself to become a capable, traveling priestess. She hopes to develop a cure against the sickness that claimed her mother one day. {/col}\n\n\n",
