				["T1"] = {
					["TX"] = "{img:Interface\\LFGFRAME\\LFGICON-WAILINGCAVERNS:256:256}\n\n\n\n\n\nA leanly muscular and tall man. His relatively long jetblack hair carries a light scent of mint, which one might notice if they were standing close enough to him. His five o´clock shadow and moustache seem to be well taken care of finishing his rugged but smooth look.\n\nOther parts that should be noted about his usual look would be the leather-tunic and his slightly baggy silk pants, the brown eyepatch and the black rose tattooed on the left side of his neck stricken across by a faded scar.\n\nThe tanning on his skin hints that he might be from the southern parts of Azeroth as does his rather unorthodox accent, his voice is low and pleasantly vibrating. He usually has a lazy warm smile painted on his face and enjoys walking around with his hands in his pockets.\n\nHis looks suggest that he would be something from his late twenties to his thirties.\n ",
