				["v"] = 40,
			},
			["time"] = 1518981281,
			["zone"] = "Silverpine Forest - Pyrewood Chapel",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "                           Her character and abilities\n When she is disguising - she will probably be discreet and polite, avoiding possible conflicts. Whilst her common character is something between cocky and derisive.\nEloaria is not very good at necromancy and don't uses it. And although she barely can be described as a swordmaster in battle, shet is still pretty good at it. Despite being very skillful in dark magic, her best weapon, as she sais, is her skills in illusions and manipulating. (Though her illusions are not very strong - a mage that clames to be master will easely see through them, if he wants)",
						["BK"] = 7,
						["IC"] = "INV_Artifact_PoweroftheDarkSide",
					}, -- [1]
					{
						["TX"] = "                                         PAST\n  Eloaria was born in Auberdine and raised as an Elune priestess. But even her faith and prayers were not able to protect her from the Scourge in her expedition to Northrend. After her death, Eloaria was resurrected as a death knight under Lich King's service. However she was defeated by Scarlet Crusade soon and for most of the undead that would have ment that they are too weak for being a death knight. Yet the Lich King gave her another chance by turning her into a banshee. This inspired her greatly and she achieved success in helping the Scourge defeat the Scarlet Crusade. After all the death knights were freed from the Lich King's control she was already not that Eloaria that she used to be while being Elune priestess. She loves the fact that she is undead and is going to use all the advantages that this state gives her.",
						["BK"] = 18,
						["IC"] = "SPELL_HOLY_BORROWEDTIME",
					}, -- [2]
					{
						["TX"] = "                                      PRESENT\nAfter Eloaria was freed of Lich King's control she decided to join the Forsaken and swear her loyality to the Dark Lady in exchange for the ability to posess not only dead but still living humanoids. Her first and by the time only mission was to to be a spy in the very hart of the Alliance - Stormwind. Considering her origin that wasn't really hard for her. In fact she even was able to get herself friends to her own surprise. Well, after all she was now able to express normal feelings and emotions again so this her new life was even intresting to her. Right now she still wasn't revealed so her mission proceeds.",
						["BK"] = 18,
						["IC"] = "INV_7XP_Inscription_TalentTome02",
					}, -- [3]
					{
						["TX"] = "                                     Devotion\nIf not mentioning the obvious loyality to the Horde, not so long ago she became a part of The Greyscale Company. She was offered to become it's part by one of her friends and participate in the compaign that company was at at the moment. She found herself many people whom she likes to think as friends of her and apparently she seem to like being part of it all. Maybe it can even be one of her purposes to live now... \nAlthough nothing lasts forever, the company was dissolved and from it formed new one, called Ashenblade company. At first it was ruled by rhe draenei who was a vanguard of the Greyscale  back in days but soon she retired and the authority to rule the company was in Eloaria's hands now. By the time, the company still exists and even grows bigger.\n",
						["BK"] = 7,
						["IC"] = "INV_Guild_Standard_Alliance_A",
					}, -- [4]
				},
				["BK"] = 11,
				["TE"] = 2,
