		["0902222504DclVN"] = {
			["character"] = {
				["CO"] = "I am.. Approachable! Whisperable if you're shy.\n\nDescription is W.I.P. due to my lazy nature.\n\nVoice Reference: Finn - Adventure Time",
				["RP"] = 1,
				["CU"] = "Happily taking place in the streets.\n\n- Check glances for speech impediment.",
				["XP"] = 2,
				["v"] = 6,
			},
			["time"] = 1475171381,
			["zone"] = "Stormwind City",
			["about"] = {
				["v"] = 7,
				["BK"] = 7,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ffffff}A social, overall open and talkative youngling who yet seems to carry a couple of fine, shy traits. He's always happy to interact with people, usually wearing a bright smile on his lips as he approaches, or they approach, but his way of conversing tends to make him feel flustered.\n\nA lisp. Unless he focuses to say specific words, the lisp is noticeable enough to make him try and avoid using the letter \"S\" in sentences. And when he cannot avoid it, he gets shy. First sign being a flicking gaze, second being red cheeks and third being stutters, it wouldn't be enough to stop him from keeping the conversation going.\n\n\nGolden honey eyes make out for his excited gaze that moves between people and objects in his surroundings. Easily distracted, yet seemingly mostly aware about what's going on.\n\nThe young man isn't the tallest of his kin, nor is he the burliest. A slender, almost feminine build, with slim shoulders and a physique that jests towards a lifestyle consisting more of books than swords. Even so, he aspires to become a swordsman one day. He's confident, and optimistic, believing he has the possibility of becoming a Knight, perhaps even a Hero one day.\nAlthough a lot of fears stand before him.\n\nSpiders, water, heights, blood(in large amounts) and dogs, to be specific.{/col}",
				},
