						["TI"] = "Equipment",
						["TX"] = "A simple shield upon his back and a basic sword sheated by his belt in a fine, dark leather sheat.\n\nIt's not the best equipment, but more like something a trainee would use.",
						["IC"] = "Ability_Warrior_ShieldReflection",
