						["TX"] = "A Southern Warrioress with a dark complexion and sun-bleached hair trinketed in plaits. Two orbs of sharp cobalt and cyan dominate her visage, framed by thick cohl lashes and windswept locks of blonde. Plump maroon lips are perpetually set in a subtly winsome pout, accentuating a dimple in her right cheek. A pair of impossibly high-set cheekbones lay wake to a remarkably rectangular jawline, constructing the contours of her countenance.\n\nA tattoo which resembles that of vines curls around the mid-section of a skeletal neck, weaving amongst eachother in a display of finely inked lines; acting as though it were a permanent necklace. However, a new addition lies upon her sternum; a golden chain with a magnificent teardrop pendant.",
