		["1113205516yjtf0"] = {
			["character"] = {
				["CO"] = "Voice: Young Clint Eastwood\nAppearance picture in about.\nApproachable =)\nTheme: Devil Makes Three - Ten Feet Tall",
				["RP"] = 1,
				["CU"] = "A lot of treated wounds.\nLeft arm hidden under the cloak!\n4/4 HP",
				["XP"] = 3,
