			},
			["time"] = 1519064348,
			["link"] = {
				["Lawland-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 20,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://imgur.com/BOqPXNV*Lawland as a Human}\n\n{col:ff001b}A Little bit of History:{/col}\n\nA  gilnean smuggler, born into an educated family of Judges and judicial workers, no nobles but wealthy. His family was renown to produce famous judges, he too should become a judge and he learned at the academy. He always had a hedonistic lifestyle, what his father never liked, but tolerated, as long he studied. After the death of his mother, his father became obsessed with the light and kind of a religious fanatic, kicking out James, after he refused to change his life and also start to worship the light. \n\nJames now out of home and money was desperate to find something to keep him liquid.\nOne dark night he met a rusty old but build man, body like a warrior. This man, called Jeffroy Whitmore, a known Con-Artist and smuggler, saw the potential in James and offered him a Job in his crew. James accepted. \n\nJeffroy saw in James that he is intelligent and knows the city and surroundings very well. \n\nJeffroys crew mostly smuggled luxury from outside the gilnean wall via boat or secret passages into Gilneas and were paid by the nobles and wealthy families. Very lucrative for James, he could life a very good life and later even became the second in Command of Jeffroy. \n\n2 years later, the Forsaken invasion and Worgen incident happen, James wanted the Gang to flee, Jeffroy forbid it and commanded everyone to stay in Gilneas and help everyone who wants to escape to escape, a change of heart James never saw in Jeffroy, after a long argument James decided to stay with Jeffroy, who actually was not going to the city center and help the refugees, but to the front where the forsaken tried to enter and was strictly going to the soldiers. James feared that they will get arrested for their past crimes. But to James surprise, some veterans and older officers actually saluted Jeffroy, an older officers lady in full uniform came unimpressed to Jeffroy and said: \"Well, well.... Came to fight a last time, Marshall?\" \n\nTo his surprise, the old Bastard, lovely often so called by James was a war hero of the Alliance in the second war.  \n\nJeffroy commanded James to go back and help the refugees. James wanted to stay and fight. But after he realized that the forsaken are overrunning the front, he finally stepped out the combat zone and run into the city and tried to find his comrades, seeing Jeffroy one last behind him while he was running, Jeffroy was bashing in the enemies with 2 swords, tearing down a lot of enemies but getting overrun with the time. \n\nBack at his comrades, a lot of them actually fled themselves but a small dedicated group now commanded by James still helped refugees to get out the city center and on the boats or to the mountains. In a basement James found a young girl, cowering. He wanted to get her out but suddenly a beast jumped at him and bite him, he bled very bad and with his last energy, he took one of his hidden pistols and shot the beast in the head. He took the girl and yelled at her that she should run. \n\nSuddenly - Blackout. \n\n\"He turned.... What can we do\"?\nI have this shit water from that cursed town, some of the fanatics drunk that, they seem at least not to be wild beasty animals ... While still, you know, god damn cultists.\"\n\"Give it to him, maybe it can stop or slow at least the process so we can get him to one of the ships and let the apothecaries take care of him\"\n\"He is a shitty monster, they gonna kill him....\"\n\"We have no other choice, here goes nothing\"\n\nJames woke up in Darnassus, the night elven capital. He know that they existed but never saw them... he was not very trusty in elves still the whole thing with the alliance and the Highelves, mostly now known as Bloodelves has mostly gone pretty south. But he needed the help, he could not process what has happened to him. He looked like a Human / Wolf inbreed and wanted his old body back. But after the nightelves helped him with medicine, rituals and other things so he can live with his situation and can turn into the two forms, he actually liked it. The new powers which increased his Body which was former not more then \"Okay\" was increased in agility and power. \n\nBut also his character has changed by the situation, after he heard what happened in Gilneas... he became more cynical but also his old Ideals came back to him. \n\nThe creation of a better world. He always had the wits, but now also the physical power.\n\n{col:0001ff}Some of his Characteristics:{/col}\n\nPositive:\nCunning, educated, charismatic, self-confident, freethinking, humorous, idealistic, realistic, practical, caring\n\nNeutral: \nDeceptive, sarcastic, stubborn, nonreligious, unpredictable,\n\nNegative: \nAimless, arrogant, cynical, decadent, disobedient, disrespectful, hedonistic, impatient, impulsive, unreliable, vindictive, \n\nHe seems to be a typical charming scoundrel, but he deeply cares for a better world, to achieve this by any means.\n\nJames C. Lawland - SI:7 Agent\n---Marks---\n    1\n\n---Health Points---\n    4\n\n---Combat Skills---\n-Weapon Training (Revolver)\n    +3 Attack (lvl 2)\n-Armor Training (Leather)\n    +2 Defense (lvl 2)\n\n---Social Skills---\n-Persuasion\n    +4 (lvl 2)\n-Deception\n    +4 (lvl 2)\n\n---Perks---\n-Investigator\n    +6 Perception\n    +4 Survival\n    +2 Intimidation\n-Silver Tongued Devil\n    +5 Deception\n    +5 Intimidation\n    +3 Knowledge\n-Clean Hands\n    +6 Persuasion\n    +3 Persuasion if Friendly encounter\n    19-20 is Critical on Social Encounters\n-Marksman\n    +2 Attack\n    +6 Attack if higher Initiative\n    19-20 is Critical on Combat Encounters\n\n---Ability---\n\"Is that the best you can do?\"\nAfter someone rolls critical Failure, James may make a comment on their failure, inspiring, or provoking, them to do better.\nAllows the person who failed to take another action after the effects of the failure has occured.\n\nIf a defensive roll is the failure, allow the person to attack with advantage on their next attack instead.\nIf the person already has advantage, allow them to make a second attack without advantage.\n\nCan be used once per encounter.(redigeret)\n\n---Flaw---\nMelee Cluts\n\nWhen ever an enemy gets within melee distance you suffer Dis-advantage to attack and defence rolls.\nAdditionally, should you be surrounded by enemies in melee range you must brace yourself.\nBracing: Gives advantage to the next defense roll, or cancels out dis-advantage defense roll.\n\n---Lite Version---\nPersuasion: +10 (+13 on Friendly encounters)\nDeception: +9\nPerception: +6\nSurvival: +4\nIntimidation: +7\nKnowledge: +3\n19-20 = Critical on Social encounter\n\n---Combat Stats---\nAttacks:\n+5 (+2 if disarmed or not using revolver)\n+11 if higher initiative (+8 if disarmed or not using revolver)\n\nDefense:\n+2\n\n19-20 = Critical success on Combat Encounters",
				},
			},
