					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{h1:c}{col:9f1d53}Appearance{/col}{/h1}\n\n{col:be9f50}A fighter. One wouldn't need to look deeper to see that. One glance is all it would take to make others understand what type of person she was. Her face showed her fierceness and her hazel-green eyes showed the fire that burned brightly in her spirit. \n\nHer hair would most likely be styled into a simple ponytail that would reach just below her shoulders and neck. On the odd occasion she might have her hair down, however. She would often dye her hair into a red-wine, mahogany colour, which she finds the most beautiful, or, she would keep her hair in its natural, light golden blonde colour.\n\nHer body is athletic and fit, the amount of training and brawling helped keep her body lean, but the countless hours in front of the forge hammering away showed in her arms. Because of her duties involving a good amount of physical labour, Jessiette's body is very healthy, a fine specimen and ideal physique for a fighter. Most would refer to Jessiette's body as tomboyish. {/col}\n\n\n\n{h3}{col:9f1d53}References (images aren't mine):{/col}{/h3}\n\n{link*https://imgur.com/GrJmlcf*Mahogany-haired Jess}\n{link*https://imgur.com/ianop4p*Blonde Jess}\n{link*https://imgur.com/A3l7CkH*Blonde Jess 2}\n{link*https://www.argentarchives.org/node/198635*Jess and Lythrin!}\n\n{h1:c}{col:9f1d53}OOC Info{/col}{/h1}\n\n{link*https://www.argentarchives.org/node/196894*My Argent Archives page!}\n\n{col:be9f50}Her history is something you should learn by actually interacting with this woman.\n\nWish to RP but can't approach? Send me a message!{/col}\n{img:Interface\\Pictures\\artifactbook-paladin-cover:256:256}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n",
