			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "At first glance...\n\n{col:ffffff}Elyza might've appeared pristine in her new apparel, had it not been for the troubles that lingered within her soul. Still she appears sorrowful, worried and at times downright frightened from the world. The light of madness shines dimly in her eyes.{/col}\n\nOn closer inspection...\n\n{col:ffffff}Time hasn't been kind to Elyza. Whereas once she may have been comely and presentable, now she is nothing short of execrable. She carries herself with a grace fit for a fugitive. Her demeanor is much the same - morose and miserable.\n\nHer tanned skin has taken on a bleak expression. Gaunt, starved cheeks betray a lack of nourishment the past few months. Hollow eyes search so desperately for joy in her life while her thin cracked lips betray few smiles. Her voice was a stark opposite to her wretched visage, betraying a definite upper class upbringing in the industrious city of Gilneas.\n\nElyza is a jittery thing, oft tugging at the ends of her sleeves or throwing cautious glances over her shoulder, for fear follows her like a shadow.\n\n{link*https://www.argentarchives.org/files/gallery_image/Elyza%20by%20acrona.jpg*Portrait}\n{link*https://imgur.com/a/S29iX*Album}\nhttps://tinyurl.com/elyzaart",
