					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{icon:INV_Fabric_Netherweave_Bolt:25}{col:951c82}Only with a quick glance her extravigant and flamboyant appearance\nbecomes evident even to the most short-sighted of folk. \nWith her bright and colourful way of dressing easily catching the eyes of passerbys, and the very air about the woman which sets the standard of style \nand beauty (if such a lady is of your taste), it becomes undeniable that she is a woman to be looked at in one way or another.\n\nShe walks with modest confidence and her inviting lips almost always curled into a welcoming smile of warmth. \n\nHer voice is no different. \n\nLaced with a deep and sensual underscore, promising wishes spill from her quick wipped tongue to possibly leave you utterly and completely entranced.\n\n\nIn short; a woman of joy and a taste for the good things in life. {/col}\n\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n",
