					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-5-3:128:128}\nYou peer upon a strange visage, long strands of hair, white and bleached fall either side of a hardened carapace of a greyish blue shade topped with oddly shaped horns, a pair of ears either side, chipped and damaged.  An strange symbol glimmering floating above, the skin itself littered by scars. \n\nBeneath it sit a pair of eyes, little more than glowing orbs, a slightly slanted nose and frayed lips following the mould.  His drooping beard following the same pattern as hair upon his scap.  On an whole, the face looks defined by severe lines, narrow angles and sharp corners.\n\nHis body, carrying the natural bulk of his kind, yet it seems subdued, slightly parched almost, still some rugged muscle can be seen beneath spread across his form. His skin is defined by the intricate gleaming patterns painted upon flesh yet marred by past injuries, echoing an history of constant strife. His tail and back embellished with gold, elaborate patterns of devotion etched into his body.\n\nHis voice, low yet firm, a certain self-assurance within.\nHis stance the crouched form of a draenei, yet standing proud and confident.\n",
