			["about"] = {
				["T1"] = {
					["TX"] = "\n{h1:c}{icon:Ability_Priest_AngelicBulwark:25}{col:fc69ff}Vindicator Auset <The Earnest>{/col}{icon:Ability_Priest_AngelicBulwark:25}{/h1}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{p:c}\n{/p}\n{h2}appearance{/h2}\n{p:c}\nShe has a slender build with the right curves at the right places.\nShe half man'ari but you can't see it and won't know unless she trust you enough to tell you.\nHer hair is onyx black  and is shoulder length with bangs parted above her left eye (like the model). A stray of her left bang is white. As for make-up she only wears is a tin line of eyeliner above her eyes\n\n{link*https://lil-annie.deviantart.com/art/Auset-716216858* look}\n\n\n\n{/p}\n\n{h2}personality{/h2}\n{p:c}\nShe's kindhearted and will protect her friends if needed. Even if that means giving her life. Thought lately she became more reserve\nShe will not back down from a fight and isn't afraid to hurt the enemies.\nShe's smart and when in trouble she will look for a way out, or die trying at least.\n{/p}\n\n{h2}history{/h2}\n{p:c}\nAuset is considered a still fairly young draenei since she was born in telaar before Draenor became the outlands.After the crash on Azeroth she starts to learn how to use the light, becoming an Anchorite. Once she has a hang of it she traveled Azeroth, learning a bit about the night elves from normad druids and later the human's way of the light as well. While voluntering in the Cathedral of Light she met her hsuband with who she adopted a child. After some rough life moments which included losing her husband and a few other friends, she returned completely to rely on the light by how her culture does it & started to train as a vindicator. Later she joined the silver hand but shortly after her daughter died as well.\n\n{link*https://www.argentarchives.org/node/185162* Auset's long history}\n\n\n{/p}\n{h2}The extra links {/h2}\n{p:c}\n{link*https://lil-annie.deviantart.com/art/winter-Auset-697119717* casual winter Auset}\n{/p}\n{h3:c}{col:d28fff}commisions{/col}{/h3}\n{p:c}{link*https://escalusia.deviantart.com/art/Draenei-Commission-716226328?ga_submit_new=10%3A1511287521*Commision done by Escalusia}\n\n{/p}\n\n\n{h3}Songs fitting for Auset{/h3}\n{p:c}\n{/p}\n\n\n\n",
