			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:712:30}{h3}{col:d8cd00}\n{icon:Spell_Holy_GreaterBlessingofLight:20} A young woman with pale white skin and thick honey colored hair that falls down past her shoulders to near her rear, a few stray locks often falling over the rather elegant structured face. \n\n{icon:Spell_Holy_GreaterBlessingofLight:20} With high cheekbones, full inviting lips, petite nose and {link*http://oi65.tinypic.com/2dkfurc.jpg*amethyst}{col:d8cd00} coloured eyes the woman carries an exotic look about her and even a noble one by the grace and posture she holds.\n\n{icon:Spell_Holy_GreaterBlessingofLight:20} All though standing slightly shorter then most, her long legs give the illusion of height, her frame that one of an hourglass which often carries dresses and robes of a fine and even an expensive design; all though the dresses may vary the woman seems to prefer wearing high heels or boots. \n\n{icon:Spell_Holy_GreaterBlessingofLight:20} When she walks there is a playful sway in her hips. Her fingers are long and elegant and often carry rings for decoration or a bracelet around the wrist, among other jewellery the woman holds two small gold rings in her left ear. It's clear this woman is from a noble blood line.\n\n{icon:Spell_Holy_GreaterBlessingofLight:20}The woman speaks with a small accent,which is hard to determine from where it comes, though it hides well underneath the rather posh voice the woman has trained to speak in. \n\n{icon:Spell_Holy_GreaterBlessingofLight:20} A lovely desert-flower aroma sits around her, given off from an oil that she uses to keep her skin smooth and soft to the touch, the woman appearing to keep herself clean and well groomed.\n\n{icon:Spell_Holy_GreaterBlessingofLight:20} She carries an aura of elegance around her and often strikes a charming smile when in company.\n\n{icon:Spell_Holy_GreaterBlessingofLight:20} Her breath smells like strawberries, due to her gum that you may catch her chewing on non-stop, creating a nice scent for people she communicates with. Her dialect is as normal as it is common, giving no pronouncing problems as she switches with ease between the common languages and her more native tongue. She has a normal and calm voice, soft undertones and is soothing to talk to.\n\n{icon:Spell_Holy_GreaterBlessingofLight:20} Her clothing which fit like made to corner every aspect of her torso, waist and hips; showing off her figure, large bust and round buttocks.{/col}{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{p:c} {icon:Achievement_DoubleRainbow:25} ARTWORK\n{link*http://imgur.com/a/TqgNV*At Gallery}\n\n{link*http://oi67.tinypic.com/33e0oew.jpg*Her tattoo resting between her shoulderblades} {/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{p:c} {link*https://youtu.be/_wU9KsU0aNQ*Her song of life}\n{link*https://youtu.be/-dhMjbrn9Lw*Her healing song}\n{link*https://youtu.be/bzuLYKaDDgE*Nami's lullaby to her daughter} {/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{p:c} {link*https://youtu.be/XQz76UgHSzk*The melody she plays on her flute}\n{link*https://youtu.be/mXQVKx0IKN4*The melody she plays on her harp (1)}\n{link*https://youtu.be/CcRPoqzOKKg*The melody she plays on her harp (2)}\n{link*https://youtu.be/CcRPoqzOKKg*The melody she plays on her harp (3)}\n{link*https://youtu.be/SwbhggRmyEw*The melody she plays on her harp (4)}\n{link*https://youtu.be/gaw_KJHkGCA*The melody she plays on her harp (5)}\n\n   {/p}",
