		["0218235635qTWXF"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Features",
						["IC"] = "Achievement_Character_Bloodelf_Female",
						["TX"] = "The elfi has piercing white-ish eyes, as expected for her kin, as well as her elongated ears. A double set of fangs line her maw also, on her bottom lip is a small golden band, piercing through her lip.\n\nBoth of her earrings and her right eyebrow is also pierced, though the bands vary from day to day.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Daggers and vials",
						["IC"] = "INV_Alchemy_EnchantedVial",
						["TX"] = "On her belt is a trio of vials and don't seem to be filled very often, for whatever reasoning. Her form however contains various daggers and needles, even a flintlock at the back of her belt hidden away beneath her cloak.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["IC"] = "Ability_Rogue_EnvelopingShadows",
						["TX"] = "A lingering aura of shadow weaves around the elfs form, slipping on and off of her frame like she's disgarding a coat. Clearly it's surpressed and dulled down, it wouldn't be hard to tell such about the elf aura.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Tattoos",
						["IC"] = "INV_Archaeology_Orcclans_Tattooknife",
						["TX"] = "Her form is decorated in ink, on the back of her left hip is a series of what seem to be elven names, her right thigh is completely covered in a dragon themed tattoo and her left forearm is also decorated in a floral design resting on a bed of thornes.",
					},
					["4"] = {
						["IC"] = "Boss_OdunRunes_Blue",
						["TI"] = "Runes",
						["AC"] = true,
						["TX"] = "Various runes are etched into her armour and skin, most of them if not all seem to be dim-lit, clearly actively used, however there's a handful that seem to be merely for decorational purposes.",
					},
				},
				["ST"] = {
					["1"] = 0,
					["3"] = 0,
					["2"] = 0,
					["5"] = 0,
					["4"] = 0,
					["6"] = 0,
				},
				["v"] = 34,
			},
			["time"] = 1519082937,
			["link"] = {
				["Zyarel-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 10,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}{col:d6f8ff}{col:d3cfff}{/col}{/col}\nA bright and alluring visage interrupted by a deep and vicious looking scar that runs across her whole face, gracing her left eye and her mouth with it’s disturbance, don’t only describe the Elven facial features but her demeanour and attitude too. \n\nA soothing calmness lingers around her, wrapped tightly in a aura of shadow magic that clings to her like a well worn coat. Even her gaze holds a certain critical coldness to it, despite the warmth and brightness of her piercing blue stare\n\nHer aura is completely compacted and contained around her, almost giving the feeling that she has full control, on closer inspection various afflictions linger on her as well as trinkets, to no doubt aid in the containment of her magic. A tear-drop necklace that reeks of void-magic is hidden under her clothing, she also has several runes on the back of her neck just above her hairline, they seem to be a dim-light purple and pulse every so often, even when she’s idle. \n\nSometimes her gaze can be seen taking on a slightly darker colouration to it’s glow, though its easy to miss and barely lasts longer than a couple seconds.\n\n Her armour is snugly fitting leathers, mainly of dark nature with the odd vibrant spurt of blood red embedded into the fabric, more often than not she’s draped in a long cloak that covers the entire of her form, lingering down by the back of her calfs.\n\nA hood and mask are never missing either, though she does commonly pull it down to reveal her features. Most if not all of her weapons and gadgets seem hidden across her form, the only thing that isn’t is a sword normally strapped at her side, judging by it’s lack of use it’s easy to deduce that it’s a last resort.\n\nDue to her firm and constant activity and training for her career, as well as the lingering threats that oppose Azeroth, Zyarel holds a form that can be considered easy on the eye, naturally blessed with curves that she doesn't seem afraid to flaunt, her armour almost highlights her figure with how it fits on her form. She isn't in any way sickly thin, a plumnness that she seems to have trained into her figure lingers on her.\n \nHer hair, if ever let out of her hood is lengthy, easily almost touching the back of her legs, regardless of its extensive length it's clear that she looks after it, it never seems tangled or messy, always neat and commonly tied up. On the left side side of her head, starting just behind her ear is a pure black strand of hair, easily spotted in the snow white avalanche of the rest of her mane.\n\nSeveral pieces of jewellery are dotted around her form, her ears contain the most of it. Various stud and looped piercings decorate both of her elongated ears, the studs are all normal gemmed studs that vary on colour. As stated above she has her tear drop shaped necklace, as well as a choker around her neck, two black gems either side of a dark blue one around her throat. A signet ring is on her hand, for some unknown reason as well as a sapphire triangle shaped ring.",
