			["about"] = {
				["T1"] = {
					["TX"] = "\n{h1:c}{col:51277c}-Faltherion Ashal'lacuna-{/col}{/h1}\n{h2:c}{col:51277c}Void Mage{/col}{/h2}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{p:c}{col:51277c}Faltherion was a thin, lithe man with sharp, angular features. While he still kept most of the typically serene and ageless hallmarks of elven beauty,  his transformation had imparted him a more gaunt and desolate appearance.  From under his long, wavy and dark hair portruded several appendiges shimmering from the dark power of the void as yet another obvious sign of his new metamorphosis.{/col}{/p}\n\n\n{img:Interface\\Pictures\\artifactbook-mage-aluneth:512:256}\n\n----------\nWork in progress\n----------\n",
