				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "A ren'dorei comes your way",
						["IC"] = "Spell_Priest_Voidform",
						["TX"] = "His sharp, angular near desolate features and his pale complexion and not to mention the strange, shimmering appendiges visible from beneath his wavy, dark hair would obviously mark him as one of the ren'dorei. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Staff",
						["IC"] = "INV_Staff_2h_DraenorCrafted_D_02_B_Alliance",
						["TX"] = "His staff is a true testament to the beauty of elven artistry. \n\nRune script adorn the parts not wrapped in soft leather. \n\nThe head of the staff consists of two richly filligreed prongs and between them floats an elemental ice crystal, suspended in place. ",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Attire",
						["IC"] = "INV_Chest_Cloth_85",
						["TX"] = "Appearance is near eveything to this man, and he harbors great pride in how he presents himself. \n\nHis attire is an elegant mix of finely woven and sumptuous fabrics and supple leather in blue and gold.  Gemstones are woven into his sleeves as both ornamentation and to hold useful enchantments. \n\nHis spaulders are made of an indeterminate golden metal and embellished with runic configurations and gemstones. The gemstones themselves emit a dull glow, suggesting they hold some form of enchantment. ",
					},
