		["[MSP]Dohna-ArgentDawn"] = {
			["about"] = {
				["read"] = false,
				["BK"] = 5,
				["TE"] = 3,
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Molten ivory diamonds peer at you as this exotic specimen of draenei perfection designs to notice your existence. Smooth flawless skin with a pale azure hue looks as soft as newborn, blue hair glimmers and shifts slightly in the wind. Her full lips curl into a telling smile most of the time with the colour of deep blue. If you eye her up and down more thoroughly you can notice her horns aiming at the sky straightly as possible. From the pose of her head it's obvious that she's proud of them. Her tentacles hang from behind her ears and coil occasionally and aimlessly in a seductive way. Lower, even with her chest fully covered by her tight outfit, anyone can notice that she is gifted. Despite the top holding them tigtly, they bounce when she walks elegantly, clearly proud to be a draenei. As you notice her her robe, it is tight on her hips,falling down from her round firm backside, covering her legs, only her hooves can be noticed. In whole her body looks mature, at first glance it's obvious she is in her prime. She is average tall and heavy as a draenei, she is slender and curvy, her body lacks most of the visible muscles as a mage should be, her menthal strength is her forte. Her skin is soft and flawless. If she turns around before you, it can't be missed that has an extraordinary tail. It's long, she could reach the ground with it without any effort. It's thickness is the same all along from the end to the bottom, and half as thick as her wrists. It has a golden ring in the middle around the tail. She folds her tail around her waist all the time, using it as a belt to keep the lower part of her robe in place on her hips, and not to bother her own moves. The golden ring acts as a \"belt strap\" holding the tail and the skirt in place around her hips. Her legs would be a bit more muscular than her body, look similar to the horses' back legs down to her hooves. Her hooves are polished and well-groomed, the edges look sharp and dangerous. If you can make her talk to you her voice is liquid throaty and mellow.\n\nOutfit made from silver thread.\n((OOC: Of course it's not an Artifact in her hand. I just love and use the look of it.))",
					},
					["HI"] = {
						["IC"] = "INV_Misc_Book_17",
						["BK"] = 1,
						["TX"] = "She was born on Argus. She wanted to be a priest but she was refused 'cause of lack of the virtues. She was accepted in the school of mages, she became a mage. Not long after her \"graduation\" she fled with the rest of the draenei saved by Velen and the Naaru. In Draenor she trained herself into a scholar. She fled again with the rest of her people and crashlanded on Azeroth. She Joined the Kirin Tor with the first mages of the draenei and offered her services as a scholar.  She can be found mostly in Stormwind Library, Dalaran Library, or  on the Exodar.",
