		["0211103119zHFdY"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["TX"] = "In a disguise. ",
						["IC"] = "INV_Helm_Mask_FittedAlpha_B_01_Nightborne_02",
						["AC"] = true,
					},
					["2"] = {
						["TX"] = "Hidden upon herself or within a pouch were a necklace, resonating with magic for any whom sough to scry it's possessor's magical origin. \n\nAnyone capable of sensing it would find a shield of arcane source, delving further into it would reveal the creator and possessor were not one and same.",
						["AC"] = true,
						["IC"] = "INV_6_0Raid_Necklace_3b",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 0,
				},
				["v"] = 25,
			},
			["time"] = 1519084065,
			["link"] = {
				["Andiine-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "Confined within a disguise consisting of snug leather in varying colors of rich brown and dim blue stood an elf of five feet and nine inches, concealed with the exception of distinct elven ears peaked out of slits in the hood and a briliant blue glow slipped betwixt gaps in the mask, providing sight through it.\n\n\nThe attire had a persistent elegance to it, from the intricate design carved into the golden mask and thread sewn into the leather to replicate a similar appearance, practical buckles and lace alike keeping it tight in place and hiding far more than one would imagine.\n\nCoiled around the hips were a belt, a pair of bags linked to it with option for additional, while the backside of each pouch serving as a sheath for a weapon, frequently filled by a curved blade of pale metal and hilt of delicate design, resembling that of a feather. While identical of apperance, one were a striking golden hue, the other a marvelous blue. \n",
						["BK"] = 1,
						["IC"] = "INV_Chest_Leather_14",
					}, -- [1]
					{
						["TX"] = "Hidden beneath the mask were almond eyes, framed by black eyelashes and freckles adoring the pale cheeks, despite a thin layer of cosmetic to hide dark circles and faded scars alike, as were a type of lip balm applied onto the lips, mixed with a soft shade of pink to give a healthier color to what would without a doubt be a very bleak appearance otherwise. ",
						["BK"] = 1,
						["IC"] = "INV_Inscription_Warpaint_Red",
					}, -- [2]
					{
						["TX"] = "Swept 'tween flawless ears were locks of silken ebon hair, reached past her shoulders in irregular lengths, implying it had been given little maintenance in regard of having it cut. Undeterred by this, it appeared taken care of, in spite of a near consistent light unkempt state, caused by wearing a helmet. ",
						["BK"] = 1,
						["IC"] = "INV_Misc_Comb_01",
					}, -- [3]
					{
						["TX"] = "Granting it were not exact, donning a suit of impeccable hide and intimate design had it's perk of displaying the general shape of the figurine, a slender feminine stature with athletic attributes. ",
