				["TE"] = 1,
				["T1"] = {
					["TX"] = "One might make the mistake of thinking that the youthful woman’s smooth tresses were woven from rays of the sun itself, for it shines and shimmers in an everlasting contest with expressive eyes of copper, where both find themselves second only to her bright smile. She smiles, speaks and laughs with a zest for life that only those unburdened by its hardships ever could. Ample curves, a buxom body, is draped in bright colours, often green and gold, with the quality of the fabric suggesting a pay grade that is neither grand nor lackluster.",
