		["0208142704U7HYF"] = {
			["character"] = {
				["CO"] = "How are you? \n\nWould absolutely love any feedback willing to be given - I'm also happy to answer questions, or give feedback if requested.",
				["RP"] = 1,
				["CU"] = "Sporting a welcoming smile - exploring the city.",
				["XP"] = 3,
				["v"] = 44,
			},
			["time"] = 1519084870,
			["zone"] = "Stormwind City",
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n{h1:c}General Sinthalos{/h1}\n\n{h2:c}The Caliginous{/h2}\n{h3:c}\"I am a changed man. Whether or not it's for the better, is your choice.\"{/h3}\n\n\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n\n{h3}Malicious Darkness{/h3}\n\n{col:ffffff}Always lingering in the back of your skull. It is there.\n\nAlways ready to afflict your next trial with doubt. It is there.\n\nWhen you stand by the side of those you love. It is there.\n\nWhen you oppose those you hate. It is there.\n\nWhen you lose those you love. It is there.\n\nWhen you conquer those you hate. It is there.\n\nBathing in the shadows cast by the light; It is there.\n\nOn the back of the coin you never seek to flip. It is there.\n\nThe question is whether you will control it, or it will control you.\n\nIn the end we are the same, our fates come down to nothing more than a coin toss.{/col}\n\n\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n{h2:c}A Brief Observation{/h2}\n\n{p:c}{col:ffffff}This Ren'dorei is a rare specimen of non-broody elf, though he paritally looks the part to a gloomy male he certainly does not play it.\n\nHe's tall with broad shoulders and surprisingly masculine features.\n\nSilver hair is messily styled about, unkempt in it's own special way with a few void-touched strands sprawled across his shoulder.\n\nUsually he can be found with something of a smile on his face, surprisingly jovial for how much of a grizzled veteran he looks to be.\n\nOf course, there's also a deep aura of void radiating from him, but it is restrained to a degree\n\nLast but not least, there's something inspiring about the way he presents himself, obviously trained in some form of leadership, considering the combination of stature, social skills, and discipline.{/col}{/p}\n\n\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n\n{h2:c}Personality{/h2}\n\n{p:c}{col:ffffff}The General presents himself with a surprising juxtoposition of kindness and coldness, while he certainly happens to be a social creature, always sporting something of a welcoming smile, there is no lack of cold calculation within him.\n\nThe ability to be ruthless is well hidden from the eyes of sociality but with a look into his gaze it's like black paint on white paper; it is clear that he's more than capable of thinking with logic, rather than passion.\n\nYet, that's not to say that he's an abominable monster, with an indepth look it appears that he's a genuinely kind-natured individual, doing what he can to make others feel welcome around him, to chatter, and of course, to smile.\n\nHe near enough exerts an aura of leadership, clearly confident enough to take charge in any situation on any day. Somehow this confidence doesn't seem to border far into arrogance, much like it would for any other elf.\n\nIt's almost like The General is much older than he looks, but the overall view of his personality after a long watch of him is actually fairly enigmatic. He appears kind and friendly, but what truly resides in his thoughts, what reason is there for his actions, if one at all? {/col}{/p}\n\n\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n\n{h2:c}A Full Observation{/h2}\n\n{p:c}{col:ffffff}There’s something strange about this Ren’dorei in the fact that everything gloomy about his appearance is heavily contradicted by his mannerisms, the male can almost always be found with some form of smile on his face, or even a sly smirk perked on his lips. As grizzled as he is he still seems jovial in personality, almost unaffected by whatever burdens subtly  rest behind his mask of cheerfulness.\n\nWith a considerable height and broad shoulders, Sinthalos has abandoned many of his delicate qualities in exchange grizzled, veteran nature - a combination of blessed genes showcases well. Even with his height and stoic look he’s not exactly a frighteningly large male, but he does do well in standing out in a crowd of his own kin.\n\nThe General has a well maintained physique, built with a combination of muscle training and athleticism, clearly harnessed over the years as for him to be able to excel in physical performance, it’s one of the many signs of his old age and experience, clearly not a body that was gained over the course of a night; several centuries has been put into his capabilities.\n\nOf course, there’s no avoiding the fact that the man is void-touched,considering how ghastly pale his skin is, in addition to the once emerald now blue hue of his gaze. Nevertheless there’s still a fiery passion in those eyes of his, juxtaposing the generally eery features. His expressions are usually kept lighthearted, shamelessly showing his joy for most situations, be it in a bar or in a battlefield.\n\nNo matter how amiable the grizzled knight happens to be, he’s still a grizzled knight. The General doesn’t try to hide the fact that he has a fair amount of age to him, the primary aspect of such being the silvery gray hair that drapes down from his shoulders, unkempt in it’s own unique way, styled differently from time to time with some of of it’s strands warped by the void, causing a purple hue to them.\n\nIn addition to his head hair he of course has quite the bit of facial hair; a well maintained full goatee has grown around the man’s maw, and of course lingers on his sturdy jawline as well, never let to descend from his chin to the point that it looks wild. It’s clear from this alone that he does take some pride in his appearance, there’s no blaming him for doing so - even with the affliction of the void, the male isn’t a hard thing to look at (For most.)\n\nNumerous scars do blemish his pale skin, much of them have been masked by the matter of age, corruption, or being  covered by the armor that he wears, no matters these benefits there are still a few that are far too deep to heal. The most prominent of his scars is a gouge across the left side of his neck, a cut down his right eye, and what might be considered worst of all; several deep lashes across his back, all delivered from heavy strikes of a whip. The countless lashes across his back have caused the skin to look absolutely revolting, it’s no wonder it’s well hidden beneath apparel most of the time.\n\nAlong with his scars he does have quite a bit of ink to him, most of it is kept under his gear but once removed it’s impossible not to notice the massive amounts of runes tattooed onto his body, sprawling, sprawling across the front of his torso and down the sleeve of his right arm, a keen eye might be able to spot the slight glow to each of his runic tattoos, and a well educated scholar might be able to uncover the meaning of the entire set of ink.\n\nStoic and yet inspiring, these two attributes of The General are something that almost seems supernaturally enforced, the male is clearly well trained in the regard to leadership, metaphorically and (somewhat) physically standing tall, but not raising his nose to those around him. His overall nature makes it clear that this man is excels in the role of command.\n\nYet, if you was to close your eyes and stand near Sinthalos, you’d be able to feel his deep, twisted corruption of the void, perhaps even a few solemn whispers if you stood close enough, if you listened close enough, or is that all in your head? Those better practiced with magic can note the male’s intense aura of darkness, amplified by the matter of being -of- that darkness, a Void elf, through and through.{/col}{/p}\n\n\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n\n{h2:c}Equipment{/h2}\n\n{p:c}{col:ffffff}No matter if he’s in a casual set of gear or fully armored, General Sinthalos always has his nobility black cloak wrapped around his form, every so often transitioning to a longcoat of some form.\n\nSheathed on his left hip is his elven longsword, Tal’dinoriel; the blade is touched by the void, warped from a powerful blade to an even more potent tool of death and destruction, rarely ever used by the General, and for good reason.\n\nThere’s always an elongated enchanted dagger sheathed on the back of the General’s waist, ready to be used in the cases of emergency, probably the most subtle weapon that he keeps.\n\nOn his right hip he has a normal enchanted longsword sheathed, though sometimes the sheathe is moved to his back, there’s nothing special about the blade bar the fact that it carries an enchantment to greatly enhance its sturdiness and sharpness.\n\nThe right gauntlet of the male’s armor possesses lethal black metal claws on the tip of each digit, all of them with minute runes carved into the back of the metal.\n\nA bag is usually strapped on the back of his waist, hiding his dagger from view - it carries a fair amount of items, but sometimes is sometimes switched for a simple pouch that carries a single, leatherback tome.\n\nA keen eye might be able to spot a hilt with two broken blades on it… remnants of an old glaive carefully sheathed below his dagger. It even seems to have spellbreaker origins to it, undoubtedly a strange thing to cherish from the past.\n\nDangling from his neck is a necklace with a purple gemstone lodged in the center of it, it’s not clear what meaning the necklace may have had, considering that all magic has been nullified on it.{/col}{/p}\n\n\n\n\n\n\n{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n",
				},
