			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Achievement_Character_Human_Male",
						["TX"] = "Keagan's most distinctive feature would most definately be the ghostly white colour of his left eye, staring back at any and all that dare glare at it. A large, slightly faded scar is drawn obliquely across it, starting at his forehead and ending at his chin. Other minor scars decorate his otherwise tanned and sun-damaged skin. \n\nThe man has a rounded face, with a big nose in the middle. His face is defined by the strong cheekbones and despite the damage done to his left eye, his right stands out as perhaps the most beautiful thing about the man. A deep azure colour, radiating warmth and kindness, though the man himself is gruff and stern. A mustache and a small beard sitting on his chin gives his face more life, bearing a ginger colour. It is well-trimmed and groomed, a defining feature, much like his hair. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Armor",
						["IC"] = "INV_CHEST_Leather_LegionQuest100_B_01",
						["TX"] = "He is covered from head to toe in a mish-mash of leather, cloth and mail. He wears a thin undershirt, with thick leather armor on top. His arms are covered in bits of mail, and a pair of gloves with the fingers cut off sits on his hands. His pants and boots are fashioned in a similar fashion, and shoulderpads added to his chestpiece for added protection.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Tattooes",
						["IC"] = "INV_Inscription_InkBlack01",
						["TX"] = "Many tattooes and markings litter his form. Various decorations of female postures and weaponry, along with runic symbols and pieces of art cover him from head to toe. A series of names is tattoed onto a blade that goes down his forearm, some have a line drawn over them, other's not. The very bottom one merely states 'The Succubus'.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Aura",
						["IC"] = "Spell_Holy_ImprovedResistanceAuras",
						["TX"] = "The man radiates a strong arcane aura, but has a series of wards cast upon him to safe-guard him and hide his true powers.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Equipment & Weaponry",
						["IC"] = "INV_Belt_Mail_DraenorHonorS2_C_01",
						["TX"] = "- A weathered leather belt is latched around his waist, carrying a variety of pouches and satchels of varying shapes and sizes that houses his various medicinal supplies, ammunition and other usefull goods. A small assortment of tools are hooked on to it as well, along with a small selection of vials with different liquids inside. In addition, a bandolier carrying a few smaller knives is strung across his chest.\n\n-Accompanying the knives in a worn, brown holster is an antique looking flintlocke with a chestnut stock, inlaid with silver decorations in the shape of vines. The initials 'K.G.' are drawn on with nice penmanship in a darker shade of red.\n\n- A jagged teeth dagger with a black handle is stuffed into a sheathe on his side. When the blade is revealed, one can spot a large number of etches made on the blade.\n\n- A scabbard is rung around his waist, carrying the cutlass on his right side. The pommel cap is carrying a bright blue gem, with what appears to be a purple fog in its center. The d-guard and the hilt is made of silver, and leather is wrapped around the grip. The blade is well maintained and shines bright when light reflect off the metal. \n\n- Carried in his hands or slung around on his back is a battle-worn rifle. The stock is made of wood, with a large number of cuts etched into it. It looks like a way of keeping score. It's outfitted with a large scope for precision shooting.\n",
					},
				},
