			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\Challenges\\ChallengeMode_Medal_Gold:128:128}\n\n\n{h2:c}{col:650809}Countess Rebecca Courtney Elizabeth Wolsey{/col}{/h2}\n\nRebecca is a noble of demeanor, her act is elegant, her words soft. She'd stand slightly above average. Never wearing any footwear to increase her height, content with her natural length. \n\nHer hair is cladded in a dark plum texture, natural silken. It'd flow beneath her shoulders, rarely containing a stray grain. Well taken care of, just like you'd expect from a noblewoman.\n\nRebecca's eyes are crystal clear, oceanic blue. The pearls alluring in their gaze, rarely would they carelessly wander. Long, natural eyelashes neatly lays on top\n\nBelow her eyes, lays her thinly sealed lips. Usually always adorning what appears to be a subtle, scarlet colour. An impeccable balance between the upper, and lower part. As they'd be perfectly symmetrical, from left to right. \n\nCulminating Rebecca's demeanor, is simply her frame. Best described as disciplined, rarely using clothing that reveals her skin, therefor hiding the defined muscles that lays within. Far from well trained, but more than what you'd expect from an ordinary noblewoman. Leaning towards a slight hourglass shape, though her midriff seems slightly thicker than what lays on a defined hourglass. Her bust slightly below average, something noticeable due to her choice of clothing.\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}{col:ffffff}Spells:{/col}{/h3}\n\n{p:c}{col:6b71ff}|| Frost Nova ||  || Ice Lance ||  || Ice Nova ||  || Frostbolt ||{/col}{/p} \n{p:c}{col:9356e5}|| Teleport || || Blink ||{/col}{/p} \n{p:c}{col:90d7ff}|| Invisibility ||{/col}{/p} \n\n\n{p:c}{icon:Spell_Frost_FreezingBreath:25}{icon:Spell_Frost_FrostBlast:25}{icon:Spell_Mage_IceNova:25}{icon:Spell_Frost_FrostBolt02:25}{/p} \n{p:c}{icon:Spell_Arcane_Blink:25}{icon:Spell_Arcane_TeleportDalaran:25}{/p}\n{p:c}{icon:ability_mage_GreaterInvisibility:25}{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{p:c}{link*http://tinyurl.com/z5k85cf*Wolsey}{/p}\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n-- Rebecca Wolsey, Councillor --\nHitpoints: 5\n\nAbilities:\nAttack: 9\nDefense: 5\nSocial: 7\nKnowledge: 9\n\nArmour: Cloth +5\n\nSpecialization:\nConjuration: +10\nEvocation: +10\nTransmutation: +5\n\n\nManifestation:\nArcane:\nFire: -20\nIce: +15\n\nFeats:\nSpellbook: Add a +5 bonus to a third specialization.\nMage Staff: Allocate two +5 bonus to manifestations, one manifestation gets a -10 bonus. This replaces the old +5/0/-5 allocation.\n\nFlaws:\n“Afraid of fire” -10 to Manifestation Fire. +5 to Manifestation Ice.\n  \n{link*http://tinyurl.com/ho4mx88*Rebecca Wolsey}\n\n\n\n\n\n\n\n\n\n\n  \n\n",
