			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\BlackMarket\\BlackMarketSign:256:128}\n{h3:c}Background and Story{/h3}\n\nMaximila-Josephina Westwood, or just Maxie or Max as her friends and family call her, is a young noblewoman of Stormwind. She is however not like the other noble ladies of Stormwind. She is an assassin,thief and poisoner skilled in killing and stealing. That is how the Westwood family first made their fortune and became nobles in the first place, by stealing other families gold and valuables. \nThis of course did not go unnoticed by the authorities and the lawkeepers. However having showed their incredible prowess in their rogue ways the king at the time decided to let the Westwood family continue their actions on one condition. That they serve the Alliance while doing so.\n\nThese days most of the family is just regular nobles but once in a while an adventurer comes along that shows true talent in Assassination. That is Maxie. She was trained by her father from a very young age to become one of the best rogues in the Alliance. When not out saving the world and killing Horde she likes to come back to her home Stormwind and unwind, walk the streets, visit the inns, all while of course pickpocketing the guards and practicing her stealth skills.",
