				["PE"] = {
					["1"] = {
						["IC"] = "INV_Jewelry_Necklace_76",
						["TI"] = "Trinkets and Jewelry",
						["AC"] = true,
						["TX"] = "Trinkets and Jewelry: Donned from head to toe in strange jewelry of uncertain origin. Intricate and of almost eldritch nature.\n\nRings and necklaces of gold laid with curious gemstones, markings and runes. Bracelets and dangles fit snuggly over delicte wrists and arms. \n\nBody chains too drape delicately along a malnourished frame; thigh straps, ankle bracelets and the like are concealed beneath garments.\n",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Careless Whisper",
						["IC"] = "INV_Misc_Herb_Whispervine",
						["TX"] = "Often found speaking in tongues to oneself.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Tarot Cards",
						["IC"] = "INV_Misc_Ticket_Tarot_Wrath",
						["TX"] = "A deck of curious cards with macabre imagery upon them.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Astronomy Tools",
						["IC"] = "INV_MISC_CAT_TRINKET02",
						["TX"] = "Carries upon their being various items occasionally used for Astronomy.",
					},
				},
				["v"] = 25,
			},
			["time"] = 1518918714,
			["link"] = {
				["Lightmourn-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n{h3:c}{col:8b59b3}Hawkish was the countenance befallen on the pale and burgundy maned femme of statuesque stature who's frame had been dainty, perhaps even frail. Nearing malnourishment and often looking sickly.\n\nDevoid of emotion most often only to be interrupted by the curl of plump lips, curious flicker of an eye and the twitch of long decorated ears. Who knew what the Elf picked up on; what curious voices spoke hushed words and vile demands. \n\nDeeplaid and darkened by nocturnal tendencies were the sockets in which rest black sclera dotted by white flecks akin to inky nightskies; of which the right one had been covered by decorated silks, a thin crude scar peeking from beneath it. Small and sharp was her nose, high were the cheekbones that stood out from concave cheeks; a hallowed grimace. Dark were plump lips often painted with onyx and single gold line in the midst of her bottomlip.\n\nDelicate and talonesk fingers blackened by onyx pigments that seeped down and followed vague outlines of veins; coiled back to the palm of each hand in which unblinking eyes had been carved. Scartissue protruded yet seemed delicate, precise. As if branded by no means natural.\n\nIndeed decorated by fine silks and beautiful delicately crafted jewelry of an uncertain origin and with symbolic charms. Necklaces, rings and earrings;  not to forget the many cuffs found upon thin wrists and rings that coiled talonesk fingers. Shoulderguards wove lace and feather into an intricate display more befitting of a queen then a speaker for the dead. \n\nThe oracle was soft spoken yet stood aloof and stoic weren't it for the occasional flinch or twitch of ears and sudden tilts of the head; single black eye darting back and forth in its deep-laid sockets. Bouts of paranoia? Or perhaps the dead sought contact, perhaps it was merely the wind.\n\nOOC:{/col} \n\n{link*https://tinyurl.com/Lightmourn*Artwork}\n\n{link*https://rpfind.me/user/FauxUnicorn*Hit me up on rpfind.me}\n\n{link*https://nl.pinterest.com/TwilightBlue/lightmourn/*Aesthetics&Looks}\n{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}",
